INSERT INTO `Event` (`id`, `user_id`, `title`, `description`, `start_time`, `end_time`, `url`, `status`, `create_date`, `thread`, `modify_date`, `modify_user`, `modify_reason`) VALUES (1,26,'CodeYear Weekly Meetup - Learn to Code in One Year ','We will be using the tutorials from Codecademy (which is mostly Javascript). At the end of the day it doesn\'t matter which language you use, it\'s about code fundamentals and getting your computer science skills up to par. This is a meetup foremost and not necessarily a class, so novices will be teaching novices - this is the best way to get started.','2012-02-17 00:00:00','2012-02-17 01:00:00','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(3,49,'Branding: Storytelling and Visual Identity','Branding goes well beyond a cool company name and logo design. A strong brand is based on a compelling story and visuals that will make customers FEEL.\r\n\r\nWhy does branding matter? Your brand impacts purchasing behavior by 1) distinguishing it is from others in the same market, and 2) evoking feelings that will result in a desired action. During this interactive session, Geekdom members Beverly Ingle and Cynthia Phelps -- and perhaps a few surprise guests -- will walk you through some of the major questions and considerations you need to explore on the way to creating excellent branding and visual identity that leads to sales.\r\n\r\nFor more details and event registration, check out http://brandingatgeekdom.eventbrite.com/','2012-02-29 18:00:00','2012-02-29 19:00:00','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(4,36,'San Antonio iOS Development Group Meetup','Introduction to Objective-C & Dropbox - Come learn about Objective-C and what is needed for working with the iOS version of the DropboxSDK. All basics like objects and messaging will be covered; also see how a basic Dropbox app works behind the scenes.','2012-03-15 00:00:00','2012-03-15 02:00:00','http://saios.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(6,82,'Convergent Media Talk Series: Jason Torres- Projection Mapping','Convergent Media is proud to announce that Jason Torres will be giving a full lecture/demo on February 15th about projection mapping. Projection mapping has an array of applications, from art installations to interactive interfaces.\r\n\r\nShort Bio: Jason Torres is a DJ and VJ located in Austin, Tx. He has a degree from UT Austin where he studied in the ACTLab and helped develop and influence the program\'s pedagogical structure. Jason is a jack of all trades, being both a musician and video specialist as well as a designer in general.\r\n\r\nPlease RSVP on our Facebook or by email.','2012-02-16 01:00:00','2012-02-16 03:00:30','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(7,60,'Lean Startup Meetup: Customers Don\'t Always Have The Right Answers','At 6:30 PM on Wednesday, February 22nd at Geekdom Jason Cronkhite will be sharing the Kulabyte story from startup to acquisition.  From late 2005 to early 2011, Jason helped build the live video encoding software company that experienced many ups/downs and 3 major business model pivots prior to the company\'s strategic acquisition by Haivision Video Networks.\r\n\r\nA great deal was learned in the process and especially how valuable the Lean Startup methodology can be to a company that is searching for product market fit.  Unfortunately, customers and the company\'s own aspirations led them down some difficult stretches.\r\n\r\nCome join us as we explore this case study and learn together.  If you missed the last event catch it here.\r\n\r\nRegister at: http://www.eventbrite.com/event/2939864213','2012-02-29 00:30:00','2012-02-29 01:30:00','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(8,15,'Geekdom Member Meetup','We\'re going to be hosting a member meeting next Monday (February 20th) at 5:30-6:30pm. We will be discussing the Geekdom educational program, SXSW plans, the new community directory and Geekdom member outreach. Food and drinks will be provided.','2012-02-20 23:30:00','2012-02-21 00:30:00','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(9,112,'Techstars Party!','Join TechStars & the following companies as we celebrate entrepreneurs at SXSW Interactive Opening Night!  ','2012-03-10 02:00:00','2012-03-10 08:00:00','http://2012sxsw.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(10,82,'Convergent Media Lecture Series: Dustin Younse and Brandon Wiley','The Convergent Media Lecture Series welcomes back Dustin Younse and Brandon Wiley. Each will be giving cutting edge talks about their latest research in media, software and beyond. This duo last spoke together in the Spring of 2011 where they filled us in on internet culture and distributed technologies and social movements. This year they are taking their focuses to new topics:\r\n\r\nBrandon Wiley: Taking Your Startup to the Cloud- The process of moving to a pure cloud infrastructure, the advantages, and the pitfalls as well as how to avoid them.\r\n\r\nShort Bio: Brandon Wiley is currently a PhD student at the University of Texas at Austin in the School of Information. He is also a former ACTLab teacher as well as student. His work spans multiple disciplines and fields with his current work looking at censorship and the internet, anonymity and the internet, hardware and software digital Art, tech start ups and much more.\r\n\r\nDustin Younse: A Crash Course in Online Privacy and Start Up Economics- What’s the product? Who’s the customer? What’s the worst that could happen?\r\n\r\nShort Bio: Dustin Younse is currently an MA student in the Radio, Television and Film student at the University of Texas at Austin. He currently works at the Institute for Public School Initiatives where he is their webmaster. Dustin is also manages Dorkbot Austin, a maker group who has regular meetings about “fun with electricity”. He recently hosted Dorkbot at SXSW, which was a huge success.\r\n\r\nMore information at: http://www.facebook.com/events/141454512641345/','2012-03-01 01:00:00','2012-03-01 03:00:00','http://www.facebook.com/events/141454512641345/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(11,15,'Mayor Julian Castro visits Geekdom','The mayor is coming! He should be visiting at 4:30pm on Tuesday, March 6th.','2012-03-06 22:30:00','2012-03-06 23:30:00','http://en.wikipedia.org/wiki/Julian_Castro','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(12,14,'Startup Ignite #5','Bill Boebel will be coming down from Austin to talk to the group. Details TBA.','2012-03-24 00:00:00','2012-03-24 11:00:00','http://startupignite.co/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(14,15,'2012 InnoTech San Antonio','InnoTech is an annual conference and exhibition built specifically for business and technology executives, highlighting the region\'s innovation and technology development opportunities by showcasing pioneering products and services. InnoTech is designed to be the most comprehensive and collaborative regional technology event available in a one- or two-day format.','2012-04-05 13:00:00','2012-04-05 21:00:00','http://www.innotechconferences.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(15,15,'Geekdom goes to SXSW! (9th, 10th and 11th)','Geekdom members are invited to join us on a trip to South by Southwest! We\'ll be there on the 9th, 10th and 11th. Buses will be provided for transportation to the event, but there are only 110 seats available, so make sure to reserve your seat as soon as possible!','2012-03-09 16:00:00','2012-03-11 07:00:00','','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(16,193,'TechStars Cloud Demo Day','April 11th we\'ll unveil the first 11 TechStars Cloud teams to go through the program. Their 8 minute company pitches will be sandwiched between excellent networking opportunities in a fun, informal, and uniquely TechStars style.  But don\'t let the informality fool you, these founders mean busi