rticipatory space and discuss how the region\'s past, present and future catalyze an international hotbed for creative spaces.\r\n\r\nUnconference themes will potentially include discussions about Creative People, Creative Communities and Creative Cities. Active sessions will develop creative collaborations and participatory innovations.\r\n\r\nBarCamps ask all attendees to participate. Don\'t let this scare you, but encourage you! Even if you can only attend for 5 minutes of the conference \"just to see what it is about,\" no worries, that is participation enough. We would rather you show up for a limited time than not make the event at all. Bring your \"show and tell\" and be excited, because awesome things are going to happen!\r\n\r\nThis is an open source event: admission is free and the ideas and conversations are for the community to create and share. CTXCamp will take place on Saturday, July 7, 2012 from 9:00 am to 5:00 pm at Geekdom, located at 112 East Pecan in San Antonio, Texas. A Happy Hour/Party will follow.','2012-07-07 14:00:00','2012-07-07 22:00:00','http://www.eventbrite.com/event/3560077287/eorg','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(114,188,'River City Circle TweetUp','You\'re invited to a Tweetup! We\'ll be featuring locally crafted beer from Pedernales Brewery which is now available for sale around our city. Much of the funding for the beer came from a \"Populist\" investment group called the River City Circle. More than 100 people contributed the funding to begin operations this year.','2012-05-24 21:00:00','2012-05-24 23:00:00','http://www.pedernalesbrewing.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(115,18,'Geekdom Guerrilla Garden Planning','Dustin Larimer is leading the discussion. Let\'s grow this thing!','2012-05-24 00:00:00','2012-05-24 01:00:00','http://geekdom.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(116,104,'Introduction to Building a Website That Converts','Building websites that sell is not an art, but an exact science. I will teach you a process that you can apply on any website to significantly boost the conversion rates hosted by Peep Laja','2012-05-22 23:00:00','2012-05-23 00:00:00','http://www.eventbrite.com/event/3395200135','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(119,123,'Kegerator Build','2 hour learn and build class where we will be building a new kegerator to accommodate homebrew kegs at Geekdom. In this 2 hours you will learn how to build a fridge conversion kegerator hands on while helping us build one. Once the initial build is done we would like to see additional reporting and electronics added to enhance functionality.','2012-06-15 00:00:00','2012-06-15 02:00:00','http://punchycode.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(121,210,'SAWPG','This month is super awesome! We\'re talking typography. Shake off some rust, learn something new, or add a new tool to your arsenal. Erik Ford (http://twitter.com/notdivisible) and Steven Darby (http://twitter.com/hellodarby) will be having an open discussion covering basic principles, strategies, and educational resources for using typography more effectively on the web.','2012-06-06 00:00:00','2012-06-06 02:00:00','http://www.meetup.com/sa-wpg/events/59849222/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(124,36,'SAiOS - iOS 6 and Mountain Lion','Apple\'s Worldwide Developers Conference is in full swing in San Francisco.  Yesterday iOS 6 and Mountain Leopard were announced for a fall release with new features, tools, and beta releases already on laptops and devices.  Come learn what to expect and what to focus on in the coming year from this open panel discussion.','2012-06-21 00:00:00','2012-06-21 00:00:00','http://saios.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(126,123,'Epic Thai Food','Personally, I think the best Thai food in TX comes from Siam Cuisine. So... dinner there, 7pm on Friday night. Come to challenge my clai