eets to highlight different neighborhoods around the city. To kick off this series, I thought we would start in a neighborhood where there are a lot of interesting things to see - Downtown.\r\n\r\nAlamo Plaza, San Fernando Cathedral and the River Walk are some of the highlights to downtown, but what other interesting sights can you find?\r\n\r\nWe are going to use Geekdom (11th floor of the Weston Building) as our home base for this downtown Instameet. We will be there at 10AM so that people can meet each other and find out the hashtag for the Instameet, as well as get a chance to see the premier collaborative workspace in town.\r\n\r\nAfter the introductions, everyone will be free to take pictures of downtown for the next hour or so. At the end, we will meetup back at Geekdom, grab a cold drink and check out the photos people took on the big screen! Prizes will be awarded for some of the best shots!\r\n\r\nHope you can attend, be sure to RSVP and ask any questions that you might have!\r\n\r\nThis is the \"take 2\" of the instameet that I wanted to have this past weekend, but had a funeral that I had to attend.','2012-07-14 15:00:00','2012-07-14 15:00:00','http://www.meetup.com/Instagram/San-Antonio-TX/725152/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(159,204,'Geekdom Poker Tournament ','Poker tournament! For Geekdom members! Yes!','2012-07-12 00:30:00','2012-07-12 04:00:00','http://www.eventbrite.com/event/3837048716','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(160,36,'SAiOS - Creating Music Instruments with iOS','Touch it, tap it, swipe, remix it. \r\n\r\nThe mobile platform allows us to embrace musical creativity by\r\ncreating sound anywhere and from anything. Learn the libraries,\r\nframeworks and tools scultping the next generation of audio\r\napplications.  Explore new ways to interact with sound and music\r\npowered by multi-tuch, motion, and more.\r\n','2012-07-12 00:00:00','2012-07-12 03:00:00','http://www.sa-ios.com/','retired','201