ming procurement opportunities with public and private agencies.','2012-10-24 14:00:00','2012-10-24 22:00:00','http://sanantonio.gov/edd','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(211,204,'Geekdom Poker Night','$20 buy in, $10 reload within first hour only (but you must be out of chips!) No limit. 1st and 2nd place get paid, 3rd place makes their money back. Blinds double every 20 minutes - or, every 5 hands once it\'s down to heads up.\r\n','2012-10-18 00:30:00','2012-10-18 02:30:00','http://www.geekdom.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(212,82,'CM@UIW Presents:  Brandon Wiley- Make a Video Game With Your Friends... Today!!!','Title:  Make a Video Game With Your Friends... Today!!!\r\n\r\nDescription:  Video games have become a pervasive part of our culture. Everyone plays video games now, from million dollar budget console games to $0.99 mobile games. However, even as the game industry begins to eclipse the film and music industries in revenue, there\'s more going on than just profit. Video games have become an art form and a part of our cultural heritage. Right now we are in a golden age of video games where the trends of indie studios, retro themes, and 8bit aesthetics have made video game production more accessible than ever before. You can start your own video game studio, and you can do it today! People all over the world are writing their own games for the first time right now by participating in game jams, contests that last from 48 hours to a month where small teams get together to create games and then publish them on the web. Game designers Brandon Wiley and Corie Johnson from Hot Trouble, Austin\'s premier amateur game studio, will tell you everything you need to know to start making your own video games with your friends. You don\'t need to be a programmer or an artist, you just need to love games!','2012-10-18 00:00:00','2012-10-18 02:00:00','http://media.uiw.edu/2012/10/04/cmuiw-presents-brandon-wiley-make-a-video-game-with-your-friends-today/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(213,179,'SEO/SEM (basic introductory concepts)','A website without proper search engine optimization is like a bicycle without wheels. It will go nowhere! Please come over and learn the basis of SEO/SEM marketing to boost the ranking of your website and generate targeted leads.','2012-10-11 23:00:00','2012-10-12 00:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/84641942/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(214,179,'Google Adwords and techniques ','Reach new customers and increase your business using Google’s Adwords online advertising program. With this service, choose where your ad appears, create a budget and analyze your progress.\r\n','2012-10-19 00:00:00','2012-10-19 01:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/84642012/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(215,179,'Social Media (Facebook Ads, Twitter, Linked In)','Social media is not a fad or a passing time anymore. In fact, it is one of the most exciting, highly effective communication tools that can provide effective and cost efficient marketing. It is also one of the most misunderstood mediums. ','2012-10-26 00:00:00','2012-10-26 01:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/84641962/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(216,242,'Leadership event','Private leadership event at Geekdom','2012-10-19 21:00:00','2012-10-20 00:00:00','http://geekdom.com/events','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(217,233,'3DS Top Secret Meetup #2','3 Day Startup event Top Secret Meetup #2 followed by happy hour at Tycoon Flats\r\n','2012-10-12 00:00:00','2012-10-12 02:00:00','http://www.3dssanantonio.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(218,233,'3DS Top Secret Meetup #3','3 Day Startup event Top Secret Meetup #3 followed by happy hour at Tycoon Flats\r\n','2012-10-19 0