:30:00','2012-11-15 03:00:00','http://saios.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(233,82,'CM@UIW Presents:  John Lebkowsky-  The Future of Media','Jon Lebkowsky will talk about how generally to consider what the future will bring, and specifically, how to think about the post-convergence future of media. The growing popularity of speculative fiction and nonfiction in the 20th century conditioned us to believe in a future that is already established: we carry strongly-held cultural assumptions about time travel, space travel, urban evolution, artificial intelligence and robotics, etc. Consider our thinking about the inevitability of space travel, conditioned in part by Star Trek, where you can travel the universe and still have perfect hair and teeth. We should drop our preconceptions about the future of media, and think creatively about the future we want. Lebkowsky\'s talk will lead into a brainstorming session about trends and most-desired outcomes.\r\n\r\nHere\'s my bio: Jon Lebkowsky is an author, activist, journalist, and blogger who writes about the future of the Internet, digital culture, media, and society. He\'s been associated with various forward-looking projects and organizations, including FringeWare, Whole Earth, WorldChanging, Mondo 2000, bOING bOING, Factsheet Five, the WELL, the Austin Chronicle, EFF-Austin, Society of Participatory Medicine, Extreme Democracy, Digital Convergence Initiative, Plutopia Productions, Polycot Consulting, Social Web Strategies, Project VRM, and Reality Augmented Blog. He\'s also a web strategist and developer via <a href=\"http://polycotassociates.com/\">Polycot Associates.</a>','2012-11-15 01:00:00','2012-11-15 03:00:00','http://media.uiw.edu/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(234,423,'Geekdom Jelly & Member Meeting','Come join us for a Geekdom member meeting Nov. 9th from 5:00 to 8:00. We want to have a massive brainstorm session with you to figure out how Geekdom can help you kick ass!  We want to learn what we are doing well and what we could do better.  Come with ideas, friends, and a thirst innovation. Greek food and Beer will be provided.','2012-11-09 23:00:00','2012-11-10 02:00:00','http://geekdomjelly.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(235,399,'Online Marketing in Today’s Economy:  Beyond the Berlin Wall and The Digital Divide','With the extent of knowledge across the globe doubling every two years, it can seem overwhelming keeping up with our changing world.  \r\n\r\nPlease join us as Kathy Swanson, President of Integrated Marketing Werx, simplifies the evolving online marketing landscape and how we got here. Enjoy the journey as she shares with us how these changes are presenting incredible opportunities for businesses to thrive as well as change the way s people purchase goods and services.','2012-11-01 22:30:00','2012-11-02 00:30:00','http://www.mktgwerx.com/upcoming-2012-geekdom-marketing-seminars','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(236,399,'Who Are Our Ideal Customers, Clients, and Constituents?','Whether your business serves consumers, businesses, or even the government, who are your ideal customers, clients, constituents and what key characteristics make them stand out from the crowd?  We will look at how people exhibit different lifestyles and behaviors, how they self-select their preferences, and what makes it possible to attract more people like them.  Join us as Kathy Swanson, President of Integrated Marketing Werx, explores this topic with our audience.','2012-11-08 23:30:00','2012-11-09 01:30:00','http://www.mktgwerx.com/upcoming-2012-geekdom-marketing-seminars','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(240,423,'Geekdom Anniversary Party','Details to come! \r\n\r\nIt\'s going to be epic, not to miss.','2012-12-13 01:00:00','2012-12-13 04:00:00','http://geekdom.com/events','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(244,179,'The im