y laughter and general mirth, they moved the party to a local brewpub in an effort to further their accomplishments for 3 Day Start Up. Born from initial friendship over local beer, weekly/monthly gatherings will ensue to enjoy and discuss craft beers, share homebrew, support local venues, welcome folks from out of town, and support craft beer in the San Antonio downtown area.\r\n A fun filled evening of beer geek friends gathering and beer drinking will be had at The Friendly Spot.  \r\n The #gdmbeergeeks community group celebrates its first meeting with Special Release from 512 Brewing - \"(512) Whiskey Barrel Aged Double Pecan Porter is a robust porter accented by locally grown roasted pecans and subtly enhanced by aging in recently emptied oak whiskey barrels. For the first ever bottling, only one 200L barrel was bottled. Notes of chocolate, coffee and pecan marry with the subtle flavors of vanilla and whiskey to make this a wonderful winter warmer worth sharing and savoring. We sincerely hope you enjoy every sip.\" - 512 Brewing\r\n8.2% ABV\r\nThis is the real deal fellow beer geeks! I know this is last minute but I just found out they received ONE MORE keg and it will not last long.','2012-11-29 22:00:00','2012-11-30 01:00:00','http://geekdom.com/events','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(281,26,'self.dev Hackathon','self.dev Hackathon is a monthly hackathon day at Geekdom. Upcoming: Friday December 14th, 2012 from 10am to 5pm (repeats every second Friday of the month). The event is for devs only and will be highly focused on devs helping other devs through paired programming, code katas, and group discussions. We welcome any developer who wants to help other developers or who needs help themselves. Lunch will be provided and it should be a great event for all involved! Let\'s start the best hackathon in the city at Geekdom!','2012-12-14 16:00:00','2012-12-14 23:00:00','http://geekdomhackathon.eventbrite.com/','retired','2013-06-05 21:00:45'