urning even the smallest website into a profitable project, without sacrificing design and function.\r\n\r\nOur session will demonstrate how to utilize HyperSites.com to build dynamic sites giving you both power and design flexibility while lowering your total cost of development.  We\'ll have founders, platform developers, and site builders on hand to share their stories, and help you down the path.\r\n\r\nDon\'t miss Matt Brozovich - he\'ll show you how HyperSites increases efficiency, which in turn can help you define your own personal economic path. He knows, because he did it.\r\n\r\nWhat are you waiting for?  Sign up now at: www.hypersites.eventbrite.com.  LUNCH PROVIDED.','2013-01-26 16:00:00','2013-01-26 20:00:00','http://hypersites.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(328,112,'Intern In San Antonio','Geekdom is excited to partner with campus2careers.com, the Governor\'s office, and dozens of San Antonio organizations to connect you with area students for internships all year.  If you are looking for extra, educated help this Spring (or beyond), you can connect with over 600 students from 13 area schools looking for internships at InternInSA on Saturday Feb 2 @ Grantham Center (TriPoint Y) from 2-5PM.  Learn more and register for only $50 (includes two tickets, a booth, and resume book in advance) at www.InternInSA.org. If you have any questions, contact the organizers at info@campus2careers.com.','2013-02-02 20:00:00','2013-02-02 23:00:00','http://www.campus2careers.com/sa/index.html','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(329,368,'Geekdom Poker Night','Friendly game of cards at Geekdom\r\n\r\nTournament starts @ 7:30pm\r\n$20 buy-in\r\n\r\nBerners-Lee Conference Room','2013-01-11 01:30:00','2013-01-11 04:30:00','http://geekdom.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(330,11,'BlogItSA!','A day long event for San Antonio area bloggers to discuss tips and technology. Local bloggers will give 