s) with another member of Geekdom to get a brief overview of their passions and their work, then DING, on to the next member. Take notes, because at the end there will be food and time for you to socialize and further network with the folks you want to follow up with.\r\n \r\nGetting to know 500+ people isn\'t easy, but we say: \"Why not make it fun!\" This will be a great opportunity to meet other members who might have similar interests.\r\n \r\nThe Meet and Geek welcomes both extroverts and introverts. Come have fun meeting other members, and get some chow.\r\n','2013-02-08 00:00:00','2013-02-08 01:30:00','http://www.eventbrite.com/event/5216231890/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(335,511,'Pinterest 101','Pinterest is one of the most popular and powerful social media tools out there brining tons of free referral traffic to websites and blogs.\r\n\r\nOn this class we\'ll be going over the basics and main features on Pinterest and show you the best and most efficient way to use this tool for you or your business.\r\n\r\n\r\n','2013-01-25 01:00:00','2013-01-25 03:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/99346712/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(336,179,'Crafting your Elevator Speech','********************This Class is on the 10th Floor**********************\r\nMr.Art Meister, who is the Executive Vice President of Top 5 Corporation, a provider of sales coaching, sales strategy consulting and training services.\r\n\r\nHe will provide training session on \"Crafting your Elevator Speech - What to say after you\'ve told them what you told them!\" Did you ever wonder if your elevator speech was compelling?  Do you wonder what to say after you tell someone what you do?  How do you keep the conversation moving?\r\n\r\nCome and develop your elevator speech and let\'s work together to open a conversation that leads to greater business opportunities.\r\n\r\n','2013-01-18 01:00:00','2013-01-18 03:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/98565202/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(337,579,'Game Dev Group Steering Meeting 2','All Geekdom members are welcome to attend.  This will be our second meeting discussing the organization of the group. We’re not discussing actual game development yet. If you are interested in helping kick off this group, please attend. It is our goal to not be a solely technical group. We need artists, thinkers, game testers, etc.\r\n\r\nBrief Meeting agenda:\r\nEstablish a charter\r\nOrganize field trips to Austin game dev groups\r\nOrganize game academy/seminars \r\nMarketing the Group\r\n\r\nLast Meeting\'s Notes\r\nhttps://docs.google.com/file/d/0B_f-k6iRkXl1VTBiMjRPd0U1Ukk/edit\r\n','2013-01-25 01:00:00','2013-01-25 03:00:00','https://groups.google.com/forum/#!topic/geekdomcommunity/xuFUL1eLLmU','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(339,179,'Build a Basic Website Using WordPress - A Workshop Seminar at No Charge!','San Antonio Online Marketing Group is proud to offer another local seminar sponsored by local businesses for local start-up, entrepreneurs and business owners. Attendance at no cost.\r\n\r\nWe\'ll focus on building a basic website using WordPress platform and spend time with hands on trainings so you can leave with a ready website for your business.','2013-01-31 14:30:00','2013-01-31 11:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/96280672/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(342,179,'Needs Assessment - An Inside Out Proposition','Join us for the next segment of our Sales Training Bootcamp - “Needs Assessment - An Inside Out Proposition.”\r\n\r\nHave you ever asked a question to your potential buyer you would like to have back?  Have you walked out of a sales encounter and wondered “what happened in there?”  Things were going so well and then all of a sudden… Perhaps if you would have adjusted the words in your needs assessment questions the outcome could have been different.  Let’s learn from one another and make the adjustments in this session.\r\n\r\nWhat’s in it for you?\r\n\r\nAn interactive session designed to develop questions you need to ask potential buyers that will lead to a greater number of successful sales outcomes.\r\n\r\nYou will develop 5 provocative questions you can ask to your buyers that will:\r\n\r\n· Show you care about them\r\n\r\n· Gain a clear understanding of their needs, expectations and performance  requirements\r\n\r\n· Differentiate you from your competition\r\n\r\nYou will learn a technique to ask the “hard hitting” questions in a non-offensive manner and design your questions from the upside!\r\n\r\nAbout Your Trainer:\r\n\r\nArt Meister is the Executive Vice President of Top 5 Sales Performance, a provider of sales coaching, sales strategy consulting and training services.  Art has a passion for the development and coaching that allows people to perform in the Top 5% and for helping them to develop their business at the executive level.','2013-02-06 01:00:00','2013-02-06 03:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/100603732/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(343,36,'Programmers Book Club','The Geekdom book club is a weekly meeting to discuss articles and publications relevant to the craft and practice of programming.','2013-01-25 00:00:00','2013-01-25 01:00:00','https://github.com/GeekdomSA/bookclub','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(344,305,'NSCoder Night','This is an informal meet-up for iOS, Mac, and Objective-C geeks, novices, and gurus. Bring your code, questions, and rumors.\r\n\r\nWe setup shop in the Berners-Lee Conference room.','2013-01-25 01:00:00','2013-01-25 01:00:00','http://geekdom.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(345,179,'REI LADS JANUARY MEETING','WELL ITS THE START OF 2013 AND I HOPE ALL OF YOU ARE OFF TO A PRODUCTIVE YEAR ALR