h clubs, but a Manchester Derby tournament final to decide the victors has never occurred.','2013-04-08 13:00:00','2013-04-08 15:00:00','http://www.premierleague.com/en-gb/matchday/matches/2012-2013/epl.html/man-utd-vs-man-city','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(403,204,'Geekdom Meditation','Sit with other people for 20 minutes and don\'t talk. \r\n\r\nNo particular practice or denomination. ','2013-03-07 13:30:00','2013-03-07 14:00:00','https://gist.github.com/gmcerveny/4169363','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(404,204,'Geekdom Meditation','Sit with other people for 20 minutes and don\'t talk. \r\n\r\nNo particular practice or denomination. ','2013-03-14 12:30:00','2013-03-14 13:00:00','https://gist.github.com/gmcerveny/4169363','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(406,204,'Geekdom Meditation','Sit with other people for 20 minutes and don\'t talk. \r\n\r\nNo particular practice or denomination. ','2013-03-21 12:30:00','2013-03-21 13:00:00','https://gist.github.com/gmcerveny/4169363','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(415,637,'Austin Global Coworking Unconference Conference','GCUC aims to bring together the best and brightest minds in the coworking movement, to share ideas and inspiration and develop new strategies for the future. Our very own Nick Longo will impart his own experience & wisdom Tues afternoon.\r\n\r\nIf you\'re attending, stop by the Geekdom Booth to see Cole & Zac, and stay to hear Nick\'s presentation.','2013-03-05 14:00:00','2013-03-07 00:00:00','http://austingcuc.com/2013/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(416,352,'LOOP : SA\'S TALENT ECONOMY','Join us for a dialogue with San Antonio\'s business leadership and young professionals regarding recruitment and retention challenges and opportunities in our city.    \r\n\r\nMaster of Ceremony:  Robert Rivard, The Rivard Report\r\n \r\nIntroduction by Darryl Byrd, SA2020\r\n\r\nPanel Discussion:\r\nWayne Pea