ash tags, engaging and connecting with the right pinners.\r\n\r\nTake advantage of one of the biggest and fastest-growing social networks out there. Pinterest brings-in more referral traffic than Google, Twitter and other major social networks. (source: http://techcrunch.com/2012/07/09/pinterest-now-beating-google-referral-traffic-plus-bing-twitter-stumbleupon/)\r\n\r\nNot only that, but more than 20% of Pinterest users BUY Pinterest products or have them ‘pinned’ for future reference!\r\n\r\nSo come on over to our class. Make sure you have an account already set up and know the basics of how Pinterest works, as we’ll be focusing mostly on tools that are useful for your business.','2013-04-11 00:00:00','2013-04-11 02:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/110761372/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(439,179,'Bootstrapping your way as an Entrepreneur, Saving Money while Making Money','As a small business we are always thinking about making money but do we ever think about saving money!\r\n\r\nLocal business owner and bootstrapping entrepreneur, Veronica Morales Founder/CEO of the Social Being: Online Marketing Firm has some tricks and tips to help you save money. Whether is for your business or home, there are several things you can do to save money while making money.\r\n\r\nFrom printing services to company picnics, she can give you the down low on how she makes it work!','2013-05-08 00:00:00','2013-05-08 02:00:00','http://www.meetup.com/San-Antonio-Online-Marketing-Group/events/110761592/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(442,204,'Geekdom Meditation ','Sit and don\'t talk, with other people.\r\n','2013-03-28 12:30:00','2013-03-28 13:00:00','https://gist.github.com/gmcerveny/4169363','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(443,204,'Geekdom Meditation ','Sit and don\'t talk, with other people.\r\n','2013-04-04 12:30:00','2013-04-04 13:00:00','https://gist.github.com/gmcerveny/41