A/bookclub','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(450,36,'Geekdom Bookclub','The Geekdom book club is a weekly meeting to discuss articles and publications relevant to the craft and practice of programming.','2013-04-17 23:00:00','2013-04-18 00:00:00','https://github.com/GeekdomSA/bookclub','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(451,36,'Geekdom Bookclub','The Geekdom book club is a weekly meeting to discuss articles and publications relevant to the craft and practice of programming.','2013-04-24 23:00:00','2013-04-25 00:00:00','https://github.com/GeekdomSA/bookclub','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(453,11,'Startup Grind San Antonio: Jason Seats ','\"Startup Grind is a global startup community designed to educate, inspire, and connect entrepreneurs. We host monthly events in more than 40 cities and 20 countries featuring successful local founders, innovators, educators and investors who share personal stories and lessons learned on the road to building great companies.\"\r\n \r\nStartup Grind is launching a chapter in San Antonio and the first enterpreneur interview will be with Jason Seats, co-founder of Slicehost, which he sold to Rackspace. He is also the managing director of the TechStars Cloud, a two-year-old program in San Antonio, based at Geekdom, to incubate new technology startups focused on cloud technologies. \r\n \r\nThe evening will kick off at 6 p.m. with beer and pizza. ZippyKid, a WordPress hosting site based at Geekdom, is sponsoring the refreshments for the event.\r\n \r\nThe interview begins at 7 p.m. and lasts one hour and will feature questions and answers from audience members. \r\n \r\nHope you can join us. ','2013-04-23 23:00:00','2013-04-24 01:00:00','http://www.eventbrite.com/event/6250303827','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(454,49,'CoFounder Meetup','It\'s that time again! Time to find your ideal co-founder.  We will be meeting and exchanging information about our companies and what types of co-founders we are looking for.  \r\n\r\nPlease send ONE ppt slide to Cynthia at HEALTHeDesigns@ gmail.com that describes your company and the type of cofounder you seek. \r\n\r\nMake sure you fill out your profile at CoFoundersLab.com.','2013-05-13 23:30:00','2013-05-14 00:30:00','http://www.meetup.com/Co-Founders-Wanted-of-San-Antonio/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(455,49,'Time to Level Up','You are putting so much energy and resources into getting that start-up off the ground and running smoothly. What if you were unknowingly compromising your productivity, creativity and your ability to interact with your team?  \r\n\r\nCome to this session to learn about the concept of Self-Compassion and the positive impact it can have on you and your team.  This is no woo-woo feel-good talk.  Dr. Cynthia Phelps will be discussing 10 years of positive psychology research that supports the correlation between a person’s level of Self-Compassion and their levels of depression, anxiety, productivity, creativity, and interpersonal relationship success.\r\n\r\nCome and take the quiz to determine your own level, and learn practical strategies to raise your levels of Self-Compassion. \r\n','2013-04-25 00:00:00','2013-04-25 00:45:00','http://timetolevelup.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(456,233,'3 Day Startup Boot Camp','* Participants ONLY! *\r\n\r\nThis is a private event for the selected participants for 3 Day Startup Spring 2013.  Boot camp will get you oriented with the language and expectations of the 3DS weekend.','2013-04-23 00:00:00','2013-04-23 02:00:00','http://www.3DSsanantonio.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(470,462,'How Lean Healthcare Can Save Your Life (While Also Saving You Money)','This talk is tailored for an audience of IT and startup professionals working with Lean Startup, Agile, Kanban, or other related methodologies. This session is a \"dry run\" of a talk Mark will be giving at the Lean Kanban North America conference in Chicago on April 29.\r\n\r\n-----------\r\n\r\nObviously, software companies are not car factories.  Perhaps the furthest from car factories or software companies would be hospitals and other healthcare facilities?  Healthcare might be the ultimate in knowledge work, yet Lean principles apply well in these settings, further demonstrating the universality of Lean.  In Lean healthcare environments, patients win, nurses, doctors, and other healthcare workers win, and the hospitals win. What does it take to make even these often impenetrable cultural fortresses accept and embrace Lean?  What does Lean look like in these settings?  What can you learn and apply to your situation by seeing how Lean fits into healthcare institutions?  In his talk, Mark Graban will talk about various types of waste in healthcare and will explain how Lean improvement and management principles are transforming healthcare, what challenges are overcome, which challenges remain, and what\'s working (or not) around the world.\r\n\r\n-------------\r\n\r\n','2013-04-25 21:30:00','2013-04-25 22:30:00','http://lean-hc-sa.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(471,847,'Cieaura Business Meeting','closed meeting','2013-04-12 00:00:00','2013-04-12 02:00:00','http://www.cieaura.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(489,637,'Social Media Breakfast','SnapTrends: Peering through the Social Media Looking Glass','2013-04-17 12:30:00','2013-04-17 14:00:00','https://www.facebook.com/events/205668122890945/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(501,308,'US News VIP Reception','SASTEMIC is hosting a reception for Brian Kelly <http://www.usnews.com/usnews/pr/experts/mgmt/bkelly.htm>, US News, Chief Editor,  to share a 2013 US News & World Report Conference update with the STEM community.  He will discuss learning and engagement opportunities for Texas partners and explore the local/regional legacy potential the conference offers for this region. San Antonio organizations will have the opportunity to showcase their local STEM initiatives and network with the community.\r\n','2013-04-18 22:00:00','2013-04-18 23:30:00','http://usnewsreception.eventbrite.com/','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(509,650,'Doing Business \"Apprentice\" Style w/Liza Wisner - How ObamaCare Affects Small Businesses','Liza Wisner is your dedicated business performance advisor, her goal is to identify the best opportunities for your company’s growth. She’ll work closely with you to understand your company’s needs and will be available to you if you have any issues along the way.\r\n\r\n\"I look forward to working with you further. In the meantime, please feel free to explore our products and services.\"  \r\n\r\nLiza\'s next seminar will focus on insurance for Small Businesses:  Specifically, how ObamaCare will affect your small business.  Her goal is to make sure you are aware of the pros and cons and the facts to make an informed business decision.\r\n\r\n\r\n\r\nhttp://www.youtube.com/watch?v=sHUguu6flx0','2013-05-09 18:00:00','2013-05-09 20:00:00','http://www.eventbrite.com/myevent?eid=6315300233','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(510,841,'Stress Management for Geeks','As entrepreneurs and geeks, stress can be a regular part of your activities. Decompress, and join Momentum Physical Therapy for lunch as we talk about steps to reducing that stress, not only mentally, but also physically. As much as you like working, it\'s equally important to give yourself that deserved break. So, take a break with us and let us help you destress.','2013-05-03 17:00:00','2013-05-03 18:00:00','http://eventbrite.com/event/6349626905?utm_source=eb_email&utm_medium=email&utm_campaign=new_eventv2&utm_term=eventurl_text','retired','2013-06-05 21:00:45',NULL,NULL,NULL,NULL),(511,855,'*CANCELED*Becoming The Professional GeekCANCELED*','In to