INSERT INTO `User_Bio` (`id`, `user_id`, `description`, `status`, `create_date`, `modify_date`, `modify_user`, `modify_reason`) VALUES (1,2,'With a successful background in developing and marketing revolutionary software, building a multi-million-dollar software company from the ground up, leveraging emerging technologies to drive innovative marketing initiatives, and forging strong customer relationships and strategic partnerships, I am proud to have established myself as a valued contributor to the Web. Combining my core strengths in brand management, team leadership, product development, word-of-mouth marketing, and business development I created many products and services for millions of users worldwide.\r\n\r\nAs the Founder of CoffeeCup Software in 1996 I launched start-up operations, achieved dramatic sales growth and expansion, and ultimately prepared the company for sale. Some of my key contributions as the Former CEO for 11 years include:\r\n\r\n• Pioneering development of a cutting-edge HTML Editor, an application enabling nontechnical people to develop personal and business websites.\r\n\r\n• Growing company from idea into a provider of 40M+ downloads of over 20 software programs.\r\n\r\n• Harnessing and leveraging CoffeeCup users to drive a 1st-of-its-kind Ambassador program, designed to empower users in evangelizing software applications.\r\n\r\n• Earning recognition as 1 of the top 5K websites visited on the internet in 2007.\r\n\r\n• Garnering outstanding success in the late-90s emerging online industry, securing status as one of the first downloadable software programs.\r\n\r\n• Achieving standing as the #1 downloaded web design software from cnet\'s download.com and tucows.com for 10 consecutive years.\r\n\r\n• Securing the #400 position in Interactive Week Magazine’s “Interactive 500” in 2000.\r\n\r\n• Winning multiple Shareware Industry Awards: Best Web Enhancement in 1999 & 2000, Best Internet Communication Software in 2001, Best Web Enhancement Software in 2002, and Best Internet Enhancement in 2002-2004. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(2,7,'Ex-Racker, leader of Fanatical Support for 9 years at Rackspace, passionate about Customer Service, Leadership Development, Marketing, Business Operations','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(3,8,'Founder & CEO @ Promoter.io','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(4,10,'As strategist and senior consultant for Compass Intelligence, Mr. Brehm’s primary responsibilities are to provide clarity and direction to clientele by evaluating, recommending, and creating innovative market defining strategies. The scope of his work deals with all aspects of the IP value chain; from delivery infrastructure and communication management to devices and terminals and end user content/applications. \r\n\r\nMr. Brehm is a regular contributor to CNBC and is frequently quoted by media outlets such as Business Week, RCR Wireless, ComputerWorld, PC Magazine, and the San Jose Mercury News and is responsible for representing Compass Intelligence at industry conferences and analyst meetings. \r\n\r\nOver the past decade, Mr. Brehm has spoken to various groups on topics including wireless services, mobile marketing and advertising, mobile content, VoIP, activation and provisioning, service creation, mobile apps, premium messaging, wireless security, fixed-mobile convergence, mobile broadband (LTE and WiMAX), the telecom regulatory environment and vertical market deployment of web-enabled services. \r\n\r\nPrior to joining Compass Intelligence, Mr. Brehm served in multiple roles for nine (9) years at Growth Consulting firm Frost & Sullivan. Prior to joining Frost & Sullivan, Mr. Brehm worked in marketing, sales management, and business development roles for Rackspace Managed Hosting and Interland (now Web.com), two of the largest pure play web hosting companies in the U.S. His responsibilities included research on the competitive landscape of the market, developing new product offerings, assessing emerging markets, improving the over all value chain for Global 1000 clients, due diligence, and acquisition analysis. \r\n\r\nMr. Brehm entered the high tech arena in the mid 1990’s working in sales management within the telecom arena for MCI and later working for Gateway, Inc in multiple roles including product marketing, product management, training, and sales management \r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(5,11,'Laura Lorek is the founder of Silicon Hills News, a technology news startup covering Austin and San Antonio entrepreneurs, companies and stories. She won a New Media Women Entrepreneur grant to start the site and has since landed additional sponsors including Geekdom! and advertising from local businesses. Previously, she worked as a senior writer for the San Antonio Express-News and as senior writer for Interactive Week magazine and as a specialty writer and technology columnist for the South Florida Sun Sentinel. Lorek has more than two decades experience as a journalist with a focus on technology and business. She lives in Wimberley and San Antonio with her husband, Charlie, and son, Teddy, and two labradors, Apollo and Zeus. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(6,15,'I make cool things for a living!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(7,18,'I’m a Designer-inventor, people watcher and time traveler.  I have an unhealthy affection for whiteboards, technology, social complexity, economics, organizational anthropology and life systems.  I practice Design as a means of igniting and accelerating the change I want to see in the world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(8,30,'Stay tuned...','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(9,31,'Many years experience in web development, circuit design, and firmware.  Interested in high level topics such as machine learning, computer vision, sentiment analysis and geospatial applications.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(10,33,'Ruby on Rails, C#,','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(11,35,'I am a patent attorney with Cox Smith Matthews (same  building as Geekdom) and I love entrepreneurship.  I am happy to help anyone who has an intellectual property related question.  Just shoot me an email or stop by.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(12,37,'2nd generation IT entrepreneur, I grew up in this industry and have applied my life to it. Started with DOS 3.1, and SCO UNIX setting up PC and nix based networks in the 80\'s, then in the 90\'s went on to work for a fortune 500 and learned how to build a datacenter while I got my MCSE. The next decade I became an entreprenuer and have been through plenty of M&A. I\'ve spent over a decade in sales, project management, needs analysis, and business process control system integration. I founded NODE to deliver IT systems for SMB through the cloud, and co-founded Media Mainframe to provide affordable and accessible internet publishing and marketing services. I\'m excited to interact with the high energy group at Geekdom and welcome anyone to get in touch with me to sit down and chat about whatever','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(13,52,'Enjoy working on ideas that help people enjoy life.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(14,53,'Tour Leaf (formerly SnappTours) can create a smartphone tour for your museum, historical attraction or campus!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(15,54,'https://github.com/wwkeyboard','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(16,60,'Christian, Husband, Father, & Entrepreneur focused on Emerging Marketing & Media. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(17,64,'Former Racker, now Co-Founder at TrueAbility.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(18,65,'Heather Angel Chandler is a San Antonio native and owner of Innovative Multimedia group, a full-service video production and web development company.  Prior to founding IMG five years ago, she worked as a television news reporter and anchor at stations in Beaumont, Las Vegas, and San Antonio.  Heather has received numerous honors for her work as a television journalist including:  Texas Medical Association Anson Jones, M.D. Award \r\nAmerican Heart Association C. Everett Koop, M.D. Media Award\r\nMental Health Association in Texas Media Award\r\nAmerican Cancer Society First Place Media Award \r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(19,66,'I started designing websites back in 1997 in high school, and have been working on my own since 2003.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(20,68,'I\'m a digital craftsman who\'s looking to make the world better one pixel at a time. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(21,71,'I love technology, collaborating with others and learning new things.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(22,74,'Over 15 years of IT experience specializing in the disaster recovery and storage market','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(23,76,'I am an artist that \"gets\" the business side of art, and I use that to help other artists and arts organizations that cringe when they think of balance sheets, strategic planning, etc. I stopped by to see your space today. As a recent transplant to San Antonio and a freelancer with most of my \"virtual\" clients in other places, I mainly work from home. Several colleagues in Minnesota raved about co-working, and I think that Geekdom would be a great place for me to spend some of my working hours.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(24,78,'Started Key Ideas when I was 22 sold part of it when I was 26. Around that time I started doing stand up comedy because it was cheaper then therapy. Performed at the Empire theatre and at Sunset Station for about 2,000 people. A few years later a couple comic friends and I created a local late night talk show that we put online. Within a few months we got it on TV and a year later got a pilot with Fox that got picked up for a full season. Been producing video ever since lately focusing on helping non profits tell their stories. One of the videos I recently produced for St. PJ\'s Children\'s home was picked up by the BBC and used for a documentary on child abuse.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(25,79,'Worked at a Navy Science lab for 23 years as an EE and Systems Engineer.  Started ZWheelz, LLC in 2007 designing and building electric vehicles.  Currently designing a new open source composite kit trike.  Looking for help, partners, funding.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(26,81,'I build stuff @growdevelopment, I\'m a WooNinja @woothemes, trying to change the world @lifewam.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(27,82,'What makes me special is I do not think I am special. I am here to help others become special. I want to see others around me succeed, period.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(28,83,'My skills: My expertise is as a brand steward. I work with companies to craft and implement marketing strategy, creative concepts and relationship management programs. Additionally, I lead the development of integrated marketing campaigns across demographic groups and media formats (traditional and digital) for companies ranging from startups to Fortune 500 corporations. I\'m also an entrepreneur who, with three other equal partners, launched a concept agency in 2004 with the sole mission of supporting larger independent general market agencies with Hispanic marketing services. Since our inception we have grown to a full-service agency, while still servicing key general market agencies. I have more than 15 years of marketing experience. I have worked in both general market and Hispanic agencies: Roger Christian & Company (Coca-Cola & Blue Bell Ice Cream), Cartel Creativo (Arizona Jeans, JCPenny and Tecate) and Bromley Communications (Coca-Cola and Procter & Gamble). At FPO I work and have worked with clients such as Coca-Cola, Gibson Guitars, Dove\'s full line of products, Nexium, Dawn, Pepto-Bismol, Pond\'s, all (that\'s not a typo, they spell it all lower case) Liquid Detergent and Snuggle Fabric Softener, NewTek, Texas Parks & Wildlife, and WHATABURGER. \r\n\r\n I have been recognized in many awards competitions including the Addys, Art Director\'s Club, DSVC, Globes, The New York Festival and the Tellys. Three campaigns I worked on are featured in M. Isabel Valdes\' acclaimed book, \"Marketing to American Latinos\" to illustrate best practices. Public speaking and volunteer gigs include the following: 2011 Texas Credit Union Marketing Conference panelist, Tear It Up: Improve Your Marketing; 2011 SXSW Panel: The Real Time Revolucion: Latin Culture in America\r\n; 2010 Hispanic Today Advisory Board (Hispanic National Chamber of Commerce) Most, Importantly I understand the huevos required to sell your story outside the company, and the audacity needed internally to keep the vision alive and true. I want to continue to learn and share.\r\n\r\nInterests: Being the Church (not the \"organized religion\" kind, but the social change kind) Conceptual artist Print making Fencing (my daughter is actually in fencing; I am her sparring partner, therefore learning to fence as if I\'m trying to get into the 2016 Olympics)\r\n\r\nWhat makes you special: My wife and mom tell me that I am. I have a hunch my wife could be saying it with sarcasm, though. I came up from South Central San Antonio at a time when people were telling me what I would be, and I couldn\'t accept their version of my future. Perhaps because of these circumstances, I don\'t accept things at face value. I don\'t believe when people tell me things cannot be changed, or that a goal is out of reach. What I know is Hispanic marketing, and the potential of the market, not just as consumers, but as thought leaders. From the research to the creative development to execution, my passion for this market keeps me awake at night and gets me out of bed every morning. The stats here are staggering, but these are the basics. Hispanics under the age of 20 account for more than 38% of the total Hispanic population in the U.S. Hispanics and Latinos across all countries of origin/ethnicities are early technology adopters, spend more time on the Internet, and love technology. At the same time, few companies are doing anything to provide and build User Experience for young Hispanics. This is a crucial part of fostering true diversity and planting seeds that could drastically improve our country\'s future: providing education, context and a common \"language\" or platform where Hispanic youth can become a positive, proactive part of the future fabric of our country by becoming leaders, entrepreneurs and educators. I believe to be successful in the change tapestry of the 21st Century, diversity will be a key part in growth and collaboration. I also believe Latin America will continue to be a great channel for technology both as users and creators. And I plan to be part of that growth and development.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(29,85,'I\'ve been programming and doing systems administration since I was 10. These days I spend almost all of my time buried in some variant of Unix. I also have an intense fascination and interest in presentation (as in: information communication). My dayjob is for a corporate defense law firm creating and managing ways to present evidence to juries.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(30,86,'I am currently in a pop punk band (www.adaylikenoother.com) in which I play bass guitar. I am a sports junkie and pretty much watch any sport on tv! Im an avid runner having ran a marathon last year, and am currently looking into buying my first road bike to participate in races for charity.\r\n\r\n\r\nI really enjoy to learn as much as I can about stuff I know nothing about. I work closely with Vid Luther (zippykid.com) and I try to learn everything there is to learn from him. I am also very good in teaching others what I know in a way which they can understand and learn from it.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(31,87,'i am eager to learn and teach!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(32,89,'Let\'s see.... What makes me so darn special.... Everything! Seriously thought, I work hard and like for others around me to be successful. Prior to starting my business I worked for AllianceBernstein and started as an entry level phone representative. Within the next year and a half I worked my way into management. When I left the company eight years was managing massive project with developers and outside vendors from all over the world. Now I\'m looking to use the knowledge and training I gained there to help grow my business and help others that I come across. I\'m always up for sharing my knowledge and recently gave a presentation on how to improve your photography at the BMPR tweetup in December. I think that I could really help others geekdom members on a frequent basis once I join.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(33,90,'Entrepreneur, budding investor, reformed programmer and author, part-time Crossfit instructor and writer.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(34,91,'I am part of a group of entrepreneurs - we have dubbed ourselves the A/Team. We speak to business owners about running a back office more efficiently and effectively. PermaSource is the only bookkeeping service in San Antonio supporting Xero accounting software. Xero is a SaaS accounting solution which happens to use Rackspace for its hosting.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(35,92,'Bootstrapping a path to acheive my entrepreneurial dreams & goals. Launched INVROX to deliver \"Innovative Solutions for Universal Demands\". Invented 3izs (three eyes) accessory for Smartphones to allow POV/hands free video and easy app access. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(36,93,'I\'m a serial entrepreneur, after many years living out of Texas, and learning how not to do it in corporate America.  Had success, failure, and now success again.  Life\'s a great journey.  Refuse to choose.\r\n\r\nPh.D, Leadership Studies (in process), MS, Organizational Leadership, Our Lady of the Lake University, San Antonio, TX (2012).\r\n\r\nAdvanced Management Program, AMP159, Harvard Business School, Boston, MA (2000).\r\n\r\nBS, Civil Engineering, Texas A&M University, College Station, TX (1982).\r\n\r\nUnited States Air Force Academy, Colorado Springs, CO (1977).\r\n\r\n1982 --- The Procter and Gamble Company (14 years)\r\n\r\n1996 --- NIBCO INC. (6 years)\r\n\r\n2003 --- STBH Distribution Company (4 years)\r\n\r\n2007 --- River Walk Executive Search (5 years)\r\n\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(37,94,' I am currently a Social Studies teacher at the School for Science and Technology. My passion is education and helping people learn to engage with their community. I also have a desire to see more diversity in technology, and want to do everything I can to get more groups involved.\r\n\r\nI also work as an editor and copy writer and love to help other people edit their writing for clarity, appeal, and efficiency.\r\n\r\nI have an MBA and a bachelors background in fashion management (advertising, buying, marketing, psychology of clothing).\r\n\r\n\r\nI want to collaborate with people to mingle my interests with technology. I also want to develop education apps for teachers to use in classrooms and for students to use to help them learn better. I think I have a unique perspective as someone who has a lot of diverse interests, and wants to find ways to incorporate technology into all of them. I\'m also very into being self-sufficient, and I\'m constantly looking for ways to learn to do things for myself rather than rely on other people to do them for me. I\'m learning to code. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(38,96,'Digital Entertainment consultant for New Media broadcast business models & development for countries outside the U.S. & domestic. , Designer for programming & original content to mobile, tablet, PC online/wireless platforms using touch centric applications.\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(39,99,'I can see the future. I can visualize the long-term effects of a decision made today. Being an engineer (M.S., Biomedical) I have good problem solving skills. I like to take initiative and I\'m very curious. I\'m also resourceful and weirdly funny. I\'m a virgo, I try not to eat beef as it has already made a monster out of me, I tweet once a month (a picture every other month), and I have a good idea (I try, that\'s where you come in) of what it takes for a small startup to succeed in the today\'s competitive market. I want to learn more about web and iOS development too. I also like to make pancakes, darn special pancakes.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(40,100,'I am a Training Consultant for JPMorganChase Bank. I have years of experience in leadership, communication, presentation and sales skills. I believe I could help your technical people learn how to sell their ideas to individuals or groups.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(41,101,'Nearly 30 years experience as a newspaper reporter and as a supervising newspaper editor gave me an expertise in long-term project work, the law (courts and legal affairs), law enforcement, white-collar crime, business and politics while working at a half-dozen newspapers in three states.\r\n\r\nMy experience as a newspaper reporter and editor uniquely prepared me for the technology world by teaching me to look beyond the obvious and try the unusual. It also hardened a self-starter mentality that is essential in the technology world. Learning always has been a key to who I am. The talents screening program, Clifton StrengthsFinder, (which I took while developing with my wife, Charlotte-Anne Lucas, content for Rackspace Hosting?s Building43 website), identified Learner as my top talent theme. That character element carried me through the twists and turns of more than 25 years as a journalist and drew me into the universe of technology where I now am exploring the worlds of live video webcasting and website building and content development.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(42,102,'We webcast community civic events from chess matches to high school robotics and municipal and school workshops and meetings.\r\n\r\nNOWCastSA is a grassroots project of CI:NOW (formerly AACIS) and is funded in part by a grant from the John S. and James L. Knight Foundation, administered by the San Antonio Area Foundation. Our Mission: NOWCastSA\'s mission is to promote and facilitate an inclusive civic conversation by empowering neighbors to identify common issues and share information through education, training, community news, events and multimedia.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(43,105,'I\'m a passionate software developer, with aspirations of being an entrepreneur. I love collaborating with other like-minded people, and I especially love to distribute knowledge and teach others.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(44,106,'I listen and analyse better than most; I am a doer and a thinker (rare combo); I value and anticipate individuals\' contributions to the discussion and/or project.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(45,107,'Okay, first of all, I\'m really a fine artist, with a BFA from San Antonio Art Institute, where I studied painting and blacksmithing. I studied film at Bard College and German at the Goethe Institut in Berlin. In my twenties I was very sociable and eclectic, jumping from one art scene to the next. I still have many close ties to the arts community in SA, though now I\'m married with kids (16 yrs), rely on hearing aids, and sing in men\'s choir downtown. Weird, right? While I still have a signature style (ink on clayboard) that I developed in the 90\'s that has a long life ahead, I\'ve become less interested in the fancies and follies of the art world and increasingly drawn to the sciences. Special? Hell yeah! But do you mean how geeky I am? Not technically. My brother Guy is the one with the CS degree. I may have completed calculus, but I can\'t make heads or tails (yet) of that algorithmic stuff. In a general sense I guess I\'m a geek, being a social misfit and constantly getting asked by people to solve their personal computing problems. Plus I\'ve got some mean-ass keyboard skills and I\'m fanatical about Web standards. How\'s that?\r\n\r\nRead full article at http://hlars.com/geekdom/ ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(46,108,'Business Geek seeks Technical Geek to collaborate with, build technology, shape the future, and retire early.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(47,109,'I am a Software Engineering major from UTSA.  I have 11 years of web design and programming experience.  My Web Design business Typhon Designs is what I spend most of my waking hours on.  ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(48,114,'Racker doing UI/UX Design, and Front End Development for the MyRackspace Customer Portal.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(49,117,'Refereeing basketball has led me to a business idea that I\'ve been thinking about for years. It\'s time I put a little more effort into seeing whether or not there\'s something there.\r\n\r\nJune Sabbatical = traveling 9300 miles to see 13 baseball games and 1 all star game.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(50,118,'Because there is no one on this planet just like me - I am one of a kind!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(51,119,'I don\'t enjoy walks on the beach.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(52,121,'I\'m a Racker! I went to the 3ds at RS and it was fantastic. this sort of access to these types of people any day of the week is an amazing thing.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(53,122,'Dance, visual art, film, fashion, social entrepreneurship, environmentally conscious events','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(54,123,'Ideas man, coder, and designer. (Oxford comma user)','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(55,124,'I like to fail fast! I am perpetually trying out entrepreneurial start-up ideas using the low cost entry point of cloud computing. In the process of collaborating and making, I hope to find the one that not only has legs ... but runs.\r\n\r\nInterests: changing the world, modes of communication, mentoring, career counseling, strategery, social media, analytics, political movements in the digital age, history, perfecting the science of hitting fastballs in batting cages, Scotland, Rocky Mountains.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(56,125,'I currently own two income tax offices and I am a project manager at Rackspace.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(57,126,'Interested in startup and VC funding world as well as disrupting large business models (real estate, media, etc.) with startups.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(58,128,'I\'m a Racker! I enjoy teaching people new skills, learning new things, and improving on what I already know. I have a thirst for success and feel like a day is wasted if I don\'t accomplish at least part of a goal. I recently relocated to San Antonio and am looking for a great way to meet new people that share my same ambitions and interests.\r\n\r\nCurrently infatuated with R/C Helicopters and self improvement. I am a geek at heart and have very few interests that are not related to technology in some way.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(59,130,'I\'m a Racker :-) I have a fire in my belly and I\'m an entrepreneur at heart. I love working in start-up environments and collaborating with like minded individuals who aspire to succeed.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(60,131,'I focus on doing what I say I will do. Practice follow-though all everything I work on. Try an act as catalyst to help others around me get things accomplished.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(61,132,'I\'m a racker :) But really I\'m familiar with the start up world and love using data to figure out what\'s going on and how to make it better!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(62,135,'My love of technology (especially new ones) lead to my belief that it is a key to making the world better for humanity. I enjoy helping people solve or find alternative methods to get around problems/hurdles. I am always willing to offer honest and constructive criticism to those who are brave enough to ask for it. Clifton Top Five Strengths Learner Strategic Responsibility Arranger Futuristic','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(63,138,'I\'m a Racker! I\'m also extremely creative. I thrive outside the box and have great ideas on the regular. I have a unique balance of tech/people skills. I dream big.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(64,139,'I\'m a Racker, who also has an interest in new ideas and enjoys helping folks.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(65,140,'I\'ve been intrested in being involved in a startup that can get big, and solve a common problem on a global scale. I have alot of intrest in eventually developing one of the inventions I\'ve thought of. My dad always was a inventor as I grew up so I always had the mindset towards new ideas.\r\n\r\nI\'m a Racker! I\'m a linux lead tech in the enterprise division.\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(66,142,'I\'m constantly thinking of new ways to use technology to make people\'s lives easier and to get more done. I believe that through technology, we can make the world a better place for everyone. Also, I\'m a Racker!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(67,143,'The past four years have been spent running monitoring systems for Rackspace. Most of my tech career has been spent dealing with Microsoft systems, although I do occasionally touch Linux systems as well. Past jobs and responsibilities have included some graphic design work, and 4 years as a DNA technician at a diagnostics/forensics company.\r\n\r\nMy current madness is driving $500.00 cars in endurance races. Seriously. Go to http://www.chumpcar.com for more information. I also (try to) play guitar, and run the sound board at my church.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(68,145,'15+ years working with young tech companies (from 10-500+ employees), both as employee & consultant. Have knowledge of all business aspects: biz models, functional areas (sales, marketing, support, finance, HR, etc.), some strategy & markets. International as well as US. Most of my roles involve some type of organizational development: building out/improving/fixing a startup, team or department in a people-friendly way. Familiar with the Lean startup methods (Eric Reis),the related \"Four Steps to the Epiphany\", Agile, & various other hot topics in startuplandia. My best & highest use is usually as a thinking partner to help startup leaders think through their situation and determine which specific next steps to take (\"drive by consulting\" -- let\'s take an hour and discuss your issue & see if we can stimulate some aha\'s).\r\n\r\nBackground in anthropology and ethnography, which I apply to business situations all the time. Longtime interest in online communities (back from before the days of \"social media\"). I\'m into media fandom (if you\'re not sure what that is, google or ask me) & have attended ComicCon (the big mothership in San Diego, plus the small local one in San Antonio). I used to be a member of TechShop in Silicon Valley & am hoping that Geekdom will be a similar deal 