ard at the dinner table damn it…and I’ve got a lot on my mind. My performance days started innocently enough as a kid trying to get attention in a big Mexican family (talk about challenges) but their love, support and slight dysfunction are some of the most invaluable ingredients I utilize to share my real life stories today. (Hence, the title of my first solo show titled, Chicana Atheist.) I studied theater classically in New York at the American Academy of Dramatic Arts and until the age 29 performed only other people’s work. I enjoyed those experiences but the freedom I get from examining my own stories has been cathartic and magical. My themes have tended to border on issues of gender discrimination, religion and of course, sex. Currently I am working on my next solo show, The AIDS Lady, which has grown from my five years of real life experience working as an HIV Educator/Tester at the San Antonio AIDS Foundation. I’ve had recent success work-shopping parts of this piece at Jump-Start Performance Co. WIP Series, Luminarias, the Guadalupe Cultural Arts Center’s Lupe Arts Blend and as a guest theater artist at Northwest Vista College. With this new work I have been able to explore the poignant yet comical every day drama of my job. It has also taken me on a personal journey through my own sexual up-bringing while engaging the audience through the strength and courage of the youth I serve and of course my colleagues living with the virus. I want to obtain an office space with geekdom to re-inspire myself as an artist. I feel this creative working space will help me get back on track with completing the writing of my solo work and support me with tools on how to produce it.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(174,291,'I\'m an architect. The kind of architect that helps people plan for and program physical places; that designs and documents buildings and the built environment; the kind that goes to construction meetings, wanders around jobsites, gets physical stuff built. I love construction. I\'ve spent a lot of my life teaching younger architects, and architectural interns, stuff they need to know about our profession. Occasionally I teach the general public things they need to know about architecture. I\'m a good speaker and teacher. Architecture, btw, is very technical. There\'s technology the way geeks think of technology - involving computers. But there\'s also building technology - the art of selecting the stuff that will go together to make a building.\r\n\r\nI teach Israeli dance. When I took over this city\'s dance session a year ago, I had four attendees. Now I regularly have a dozen, and they are threatening to bring more. These dances can be quite complex, they require a lot of brainpower to remember, and I am proud of facilitating a community that moves for fun. Of course I like other kinds of dance, too!\r\n\r\nI\'ve been in co-ops since 1977. During college was Director at the Ark, a residential coop of 100 students in Austin, and as a result sat on the Board of Directors at College House Co-ops, which is a consortium of larger housing co-ops. I\'ve belonged to Wheatsville Co-op ever since, and when I look back at the things that have mattered in my life, that\'s one of the most significant. I\'m a yankee jewish female architect in Texas. Believe me there are not a lot of us!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(175,292,'PJStyle.com\r\nI have a lot of enthusiam for exciting new ideas. When I get fixated on an idea, there is not much that can stand in my way of accomplishing it.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(176,293,'Passion, creativity and overcoming obstacles. Collaboration fuels my desire to change the world through innovation. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(177,294,'I try to spend every free moment that I have with my wife and 4 month old son. A typical weekend would involve going on a run with the family and laying out a blanket in the park. 