 of Monk\'s Toolbox is on the part of the business that these entrepreneurs understand most: brewing. By approaching business management through the brewing operations lens, we are already speaking in terms the brewer understands which means we greatly lessen the learning curve. Our cloud based, mobile enabled product will provide a low cost, scalable business management tool that focuses keeping the brewer off the computer so that they can continue to focus on making high quality craft beer. And we have already told you that everyone loves beer, especially great craft beer.\r\n\r\nWe take the back-office out of brewing.\r\n\r\nCheers,\r\nZac','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(223,353,'im awesome, fast learner.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(224,354,'I am a Georgian!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(225,355,'I graduated valedictorian of my high school, and worked for four years in my schools, ROTC. After 2 years of pursuing a degree in Electrical Engineering, I wish to test what I\'ve learned in the field while serving the community.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(226,357,'Laser like focus and extreme agility.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(227,358,'I\'m currently a student at Trinity University. I helped launch Cabstr out of 3DS and am currently continuing to work on Cabstr. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(228,359,'	I\'m a classic \'dreamer\' or \'idea guy\'. I tend to see the world around me and think up ideas to make it easier, or to make a dollar off of something that doesn\'t yet exist, but should. From a UAV pizza delivery service to a solar-energy harvesting car-cover, I write down my outlandish ideas in hopes of one day seeing them through. I like to look at problems from a multitude of angles, and see where the solutions best fit and what issues might arise (technical or otherwise) and find ways to overcome them. I have a food based product idea that 