n industries that are behind the technological curve and have the opportunity to save millions of dollars a year in multiple departments and across the entire stakeholder supply chain spectrum.\r\n\r\nSpent 16 years in the corporate world working for 2 large transportation and logistics companies servicing supply chains across multiple countries. Turned entrepreneur in 2011. Lean methodologies, based on the Toyota Production System, is our driver for sustainability.\r\n\r\nWe focus on 3 industries in needed of downstream renovation and automation:\r\n1-Mining (aggregate materials)\r\n2-Heavy Construction (roads, bridges, buildings)\r\n3-Energy (Oil & Gas)','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(284,428,'My background is in architecture and that is the core service of the start-up I am working to create. In ten years of slogging through my chosen profession, I have grown accustomed to managing projects of various sizes and complexities for a variety of different types of clients and organizations. I have also been involved in the acquisition of these projects and in doing so have developed a range of graphic design, marketing and other collateral presentation skills. In addition I have taught at a number of universities throughout Texas including, Texas Tech, UT Arlington, UT Austin and Trinity.\r\n\r\nIn recent years I have also become increasingly involved in the creation of photo and video content. The experience and equipment amassed in support of this ongoing effort now represents a supplement to my larger architectural efforts.\r\n\r\nFor the last several years I have been engaged in an effort to document and analyze the courthouses of Texas. My ongoing research into this subject has culminated in a book that is currently under peer review at the University of Texas Press. A more recent project is my daughter, Sammy, who was coproduced with my wife. In addition to forcing me to be efficient, Sammy has made me keep things in perspective while helping me see the world for the truly remarkable place that it is.\r\n\r\nArchitecture is by nature a collaborative art, but that teamwork rarely extends beyond the borders of the profession. I believe true innovation occurs at the boundary of disciplines and that I will be able to create better architecture by learning from a broad spectrum of fields.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(285,429,'Our company, Adjacent Applications, is based out of San Francisco, and I live in San Antonio, but I will be traveling to various Military installations over the next year. Our first app is Call Dibs: A Community Exchange. www.calldibsapp.com.  I am also a Business faculty member for Western Governors University.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(286,435,'Current CS Graduate Student (Security) and IT Consultant.  My original degree was in Environmental Engineering and I have been doing tech since the mid-1990\'s.  I\'m experienced with Windows, Apple, and Linux/UNIX networks, Windows network admin (Exchange/SQL/AD), network infrastructure, web hosting and languages (LAMP, PHP).  I\'m also an amateur meteorologist and a musician (tuba) and an AV tech (lights, soundboard).','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(287,436,'I\'m an ex Army Military Police officer and after 11 years of service and a desire not to get killed on my next deployment, I decided to go back to something I love, programming. After leaving, through DeVry, I earned my bachelors in Computer Informations Systems with a concentration in Web Game Programming and I\'m working on my masters at Keller in the same field but with a concentration in Project Management. I have \"school knowledge\" with very little \"real world knowledge\". I\'m hoping to acquaint myself with real world people.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(288,437,'Raynaldo (Ray) Lopez, an accomplished corporate professional with over 34 years experience in the information and telecommunications industry, retired in 2009 as a Director from AT&T where he led a team of Technology Professionals in the Signature Client Group and was responsible for a multimillion dollar business portfolio. His responsibilities included managing executive relationships between AT&T and its largest clients by identifying business drivers, creating synergies with his client and focused on developing and executing effective long term strategies. \r\n\r\nUpon retirement, Ray established REV Enterprises, Inc. and focuses on Information Technology Consulting and Management. He serves as President and CEO and uses his vast experience to develop large scale technology solutions. He leads a specialized technology team in support of Domestic and International projects including design, implementation and support with specialization in call center and data center services.\r\n\r\nIn February, 2012, REV Enterprises, Inc., a Texas HUB Certified Corporation, became the exclusive Promethean Premier Business Reseller in Texas. The robust Promethean product line is focused on leading edge collaborative whiteboard technologies. \r\n\r\nIn conjunction with his corporate experience, Ray has a longstanding, strong civic commitment including key leadership appoints. He has been elected to several high profile governance positions and in May of 2009 he was elected to the City Council of the City of San Antonio, District 6. In 1990, he was elected to the Northside ISD Board of Trustee and served three terms, including President. \r\n\r\nRay has received recognition for his professional and civic work including being named to AT&T’s Leaders Council & Circle of Excellence, recognized by the Hispanic Who’s Who in Texas & United States and was inducted to the Harlandale ISD Hall of Fame for his life long work in education and community service.\r\n\r\nRay and his wife Evelyn have four grown children. Besides hobbies of golf, sailing, snow skiing and travel, and specially enjoy spending time with their family and spoiling the grandchildren.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(289,438,'Have worked in the Wireless Industry for the last 9 years with the last year as Owner & General Manager of a Wireless Retail business. \r\n\r\nIn February of 2012, became Director of Operations for REV Enterprises, Inc. REV is the PrometheanWorld exclusive business sector partner in Texas.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(290,439,'If I can get away from my computer, I\'ll be sure and let you know. I kid of course. I\'d first list \"history\", since it\'s not very tech related. Unless, of course we\'re talking Pascal, the historical programming language, not to be confused for the historical machine calculator inventing Frenchman it is named for. My \"interests\" are quite vast. If I had one word to describe myself it would be \"polymath\". Interests outside of a cerebral nature would include family: my daughters are nine and ten, and very active in sports, much as I was until I became a dad, and I coach them, or at least assist. I grew up playing baseball, I was an AAU and college decathlete, a competitive amateur boxer, and played football into college, so track & field, boxing, and football are my favorite sports, though as a sports fan, I\'m a huge Spurs fan who could run, jump, dunk, dribble , rebound and pass, but couldn\'t make a jump shot if my life depended on it. I have not been very or at least consistently physically active for the last decade and hope to change that and I\'d like to run my first marathon before I turn forty, so I better get going. I\'m also an award-winning screenwriter with a passion for producing narrative and documentary style cinema and television. I\'ve burned a lot of money and time in this arena. I\'ve pitched to networks, big production companies and studios. I\'ve optioned a screenplay to a mini-major that is now basically defunct, had my own docu-series projects in development with big time reality television production companies until they fell apart in casting. I have plenty of friends in this business and I may never make my living doing it, but I\'ve had fun, so no regrets.\r\n\r\nJust sit back and relax as this is going to take a while... First, I\'d like to use a substitute word like \"different\", because \"special\" might imply I\'m eligible to ride on a short yellow bus (BTW, I have nothing against short yellow buses and I\'d gladly help those on who need to ride them). Aside from being conceived at an acid party (allegedly), I\'m different because I have a maverick approach to life. I do things I do, well, but often against the grain, nontraditional, if not backwards. For example, I didn\'t finish college in my early twenties, but became COO of a small corporation that I directed from under $1 million when I arrived to nearly $2 million a year in sales revenue, and this I did before I turned thirty. Now, I\'m 38, we sold that company six years ago, I’ve burned through my money since with entrepreneurial endeavors, and recently I went bac k to school to finish my BBA in Entrepreneurial Management (The University of Iowa - Tippie College of Business Online BBA Program), so hopefully one day I could land a good job in a high growth industry. I\'m not a real geek, a dork of a daddy maybe (or so my girls tell me), but not a real geek. Though, I wouldn’t mind if I were. I say that because I\'m far too intellectually literal and not intellectually technical enough to be a real geek. However, I quickly recognize potential, even when it is technical in its nature. When creative thought collides with analytic thought an entrepreneur can form. This is my affliction, and it\'s been blessing and burden, the latter when the analytic was outweighed by the creative. I\'m now back in school full-time, but for the last six months I\'ve been involved in the startup development of a cloud-based SaaS vertical. We have an excellent business concept, and as of two-weeks ago, an equally excellent business plan. The co-founders live in the Los Angeles area, I\'m in San Antonio, and in name, I’m director of business development (this vertical is the industry I’ve spent most of my professional life in). We had a “GoToMeeting” conference today with a Texas based VC firm that I reached out to (and the only VC firm we\'ve contacted). They recognize our market potential in a vertical with 1.4 million firms that is remarkably still untapped in terms of our industry tailored \"user friendly\" collaboration suite, but they want to see the beta in action before making a decision on partnering. We are co-branding and white labeling, including with a (still developing) adapter by CITRIX (which we had to sign an NDA to explore), but we do need our proprietary app to seam them all together and we don\'t have a tech partner or the funding to create the beta or a demo product. I\'m a student, but obviously, nontraditional in terms of age, business experience, and knowledge, but I’m new to IT and the cloud, and would love the opportunity to explore the Geekdom community, for both self-education and collaborative talent. Perhaps, one day I can channel the spirit of my deceased uncle, who was one of the top PeopleSoft gurus in the country when he died suddenly at a client’s corporate headquarters in 1998. He was just forty, and well on his way to becoming a multi-millionaire, as a co-founder of the fastest growing HR software consulting firm in the country (the company fell apart without him). The top sales people at PeopleSoft referred him on all their sales to the Fortune 500s and top consultants wanted to work for him. That guy was a real geek. I know he would love \"Geekdom\".','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(291,440,'I have a wide range of experience from development, knowledge engineering to taking new products to market, both in the Federal and Commercial arenas. I want to share and build on this experience with those who are leveraging, inventing, or just dreaming of the emerging technologies that will transform our world in the next 10, 5, 2 years.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(292,442,'I dont know how old I am in that photo. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(293,443,'I enjoy playing video games, and I\'ve recently taken up golfing. My biggest love is just learning, though. I don\'t care what it is. I\'ll sit through a class on History, Archeology, Astronomy, Engineering, Physics, almost anything. I enjoy reading books as well, and tend to alternate between Fantasy and Sci-Fi for fun, and then read several serious books a year in order to make myself better at running a business.\r\n\r\nI\'m the CEO of a company I started myself after getting out of the Army. It\'s still too early to call it successful, but we\'ve had a lot of big wins, and I\'m incredibly happy with where we are right now. I want to bring that experience to the community and make myself available to help mentor and encourage other fellow geeks in taking that step into consulting or building a business.\r\n\r\nI have a very acidic sense of humor that I think most find entertaining, and even though I\'m really a loner by nature, I always tend to find an easy place in groups. I enjoy hanging out with other fellow geeks and I think it\'s encouraging for those like us to know there are more out there and that we\'re not alone in a sea of mediocrity. =)\r\n\r\nI also occasionally write articles for a website called TenTonHammer (paid for it and everything!), which some folks find interesting. I\'ve found it a pretty rewarding experience and it\'s definitely helped to fund my gaming hobby.\r\n\r\nMostly, I\'m special because I\'m just really awesome. I\'m interested in hanging out with other awesome geeks as well.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(294,445,'I have my mind in both the liberal arts and business; along with a little bit of tech. Hence I have a major in Art and Finance. These perspectives