all over the city, geared toward the arts as well as events for Need for Seeds Children\'s Organization.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(300,455,'I am currently a Neurosurgery resident with an interest in business, investing and technology, especially biotechnology and medical information and decision-making.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(301,456,'I was a theatre and psychology double major in college. I am a published playwright. I\'ve written 2 novels. I\'m currently training at endurance bike riding for a 545 mile ride from San Francisco to Los Angeles in June of 2013. I taught myself to can jam, I bake my own bread, and I learned how to quilt about 3 years ago in an attempt to keep a promise to a dying friend. I don\'t just read books, I consume them. I dabble in photography and oil painting, but am not going to pretend to be good at either of them. I\'m most likely going to teach myself to make soap next, because I clearly don\'t have enough hobbies.\r\n\r\nIn case you can\'t tell from the interests section, I have a hard time sitting still. There\'s just so much to do, to learn. I\'ve never understood the words: \"I\'m bored\" or the people that utter them.\r\n\r\nI\'ve long envied folks who are \"specialists\" in their field...but I\'ve recently come to grips with the realization: that is not me. I\'ll never be Michaelangelo... and that is ok, because I AM MacGyver. The Sistine Chapel is indisputably lovely, but have you *seen* what I can do with a wad of gum, a fedora, and a mason jar?','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(302,457,'I bake pastries in large quantities and bring them in to the office.\r\n\r\nI love to learn from others and share what little I know.\r\n\r\nI have a good sense of humor and give good compliments.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(303,459,'As a married father of 6, businessman, employer and mentor/coach to hundreds, I am a busy guy that is looking to make a big difference. My main goal is to help all people understand that being an entrepreneur is more of a state of mind than anything. I am on a mission to break the entitlement mentality that stifles the growth of many employees.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(304,460,'I\'m awesome! :) I\'ve got a talent for seeing and solving complex problems at lightening speed. My php chops aren\'t to shabby either. Even with my technical talents, people often look confused when they interact with me, usually telling me I should be in sales... Whatever that means!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(305,461,'Strong business partner management and product marketing background with a solid understanding of the product lifecycle process.\r\n\r\nCurrently work at Rackspace in the Channel department.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(306,462,'Entrepreneurship - employee of an Austin startup from 2001 to 2004. Currently on the management team of a Texas-based technology startup, KaiNexus (www.KaiNexus.com). \r\n\r\nBlogger (since 2005 - www.leanblog.org) and podcaster (since 2006 - www.leanpodcast.org).\r\n\r\nI\'ve worked with the \"lean\" methodology in manufacturing since 1995 and in healthcare since 2005... have been a student of \"lean startups\" since late 2009 when I had a chance to meet Eric Ries.\r\n\r\nI work also as an independent consultant, author, and speaker for hospitals and health systems. I am the author of two published books, \"Lean Hospitals: Improving Quality, Patient Safety, and Employee Engagement\" and \"Healthcare Kaizen: Engaging Front-Line Staff in Sustainable Continuous Improvement.\"\r\n\r\nI\'m happy to mentor and teach others. Looking forward to working at geekdom a few days a month when I\'m not on the road with clients and being part of the community. MIT graduate, 1999 (MSME and MBA). Two patents.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(307,463,'I really like to help people on a team or otherwise by sharing my knowledge and skills. I am a technical person but I like to look at things I do with a broader perspective than just the technology I\'m building.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(308,464,'Film maker, Anthropologist, Documentarian, Media Consultant and Podcaster','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(309,465,'I like to think I occupy the revered spot at the intersection of the left and right lobes with my approach to business and life.\r\n\r\nI\'m in to:\r\n- Painting\r\n- Comic books\r\n- Film\r\n- Film Production\r\n- Zombies','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(310,466,'I\'m about to launch a Kickstarter project for the opencanard project!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(311,467,'I wouldn’t say I’m special but I do have a burning desire for entrepreneurship and web creation. I only heard of Geekdom a few weeks ago and I just knew that I had to be a part of this technology movement. I read about Silicon Valley start-ups all the time in Inc. magazine, I read about web development in Net. Magazine and to think that environment like that has been developed in my hometown, I WANT IN!!! I will do what I can to help others in the time I am afforded.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(312,468,'My passion is in creativity, inspiration, and process. I\'ve written down over 180 pages of ideas in my engineering notebook. I even drove around the country, traveling over 8000 miles to share my ideas with executive directors, deans, and editor-in-chiefs of architecture related professions and organizations.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(313,469,'AMAZINGJELLYBEAN.COM, AIRLOOM.CO, NETDATAPAD.COM \r\nI love working with people and most of all I enjoy helping people achieve their dreams. I also have a great inner peace and attitude!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(314,470,'I should probably focus attention on my ability to help start-ups create a successful sales strategy and infrastructure...but what really makes me special would have to be my freakish ability to remember damn near every line from every movie I\'ve ever seen.....ever. \r\n\r\nDid I mention \"ever\'?','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(315,471,'I was born at a very early age.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(316,473,'I think I can take geek speak and turn it into common language and make legalese understandable.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(317,474,'Creative and artistic in all aspects of life. Feel the need to create, make stuff, and be awesome. Love to learn, share ideas and knowledge I\'ve learned with others. Former Marine and love to work, ecspecially in the tech world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(318,475,'25 years people leadership & mentoring experience. 5 years life coach experience. 17 years IT / Technical Operations experience. Problem and Incident Management, Development and QA leadership experience. Compliance and Audit experience. Experienced group facilitator. led merge and acquisition projects. facilities management and construction oversight.\r\n\r\nconsulting and workshop experience in Blue Sky Visioning, Change Leadership, business plan development, women empowerment. \r\n\r\noh, I was a licensed real estate appraiser, paralegal, mortgage underwriter and title closer. I am a certified hypnotist, meditation instructor and past life regression therapist.\r\n\r\nI genuinely care for others and the world. I believe we are all interconnected and are mirror reflections of each other. when we interact and exchange our thoughts and personal expressions of insight we expand our potential. wisdom is innate and simply needs to be encouraged to stick its head out. we learn, grow and expand together. \r\n\r\nI live my life with the question of who am I and what am I here to do that only I can do, fundamentally? I live each day as though it was my last in gratitude and appreciation for the beauty of everything and everyone from here anything is possible. \r\n\r\nI\'ve been through hell in my life, failure and success. they have made me strong and determined. I welcome moments of humility as surrender has been my greatest teacher.\r\n\r\nbut you\'d have to spend time with me to truly get why I am so uniquely awesome and special.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(319,477,'I play drums, guitar, sing and know a little piano. I draw with anything, but blood, I love the great outdoors and camp and bike often. I love the lake, the ocean and drive there every few weeks, I love animals, friendly people, parties, hammocks, traveling and eating.\r\n\r\nI began school studying medicine. Joined the army and was studying respiratory therapy, fractured some bones, was medically discharged, went on a cruise, went back to school, focused on art with double minors in spanish and music, worked at apple, quit the corporate world, went to mexico, then a year later went back to school and obtained my second degree in theatre. That\'s only the last ten years or so. I have have gained lots of experience in my travels and education and life, and know i have lots of knowledge to share and vital skills to offer. There is only one of me in the world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(320,478,'My background is finance. I have experience in marketing and strategy as well. I have led the marketing strategy for 14 different bank products with two separate large banking organizations.\r\n\r\nI have also consulted several new business owners and helped them launch and expand their companies. All of the companies (less than 10) are still in business and are all profitable.\r\n\r\nLastly, I have 11 years of experience in the U.S. Army (Infantry). This helped me to stay focused and disciplined in my business approaches.\r\n\r\nI love investing and trading. I love for investing and trading started in 1999. I eventually became consistently profitable enough to retire from corporate and pursue this business opportunity (a computer program) that will help other invest and trade profitably as well.\r\n\r\nI love helping people become what they are supposed to be. I love all things finance. I can do both of these all day.\r\n\r\nI believe that, in order to become truly successful in business and life, you have to help others get there. By focusing on helping others, you will become wealthy (not just mentally but financially as well).','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(321,479,'I\'m awesome? No, but really... I went to SW SA at Geekdom and fell in love with the people and the place. Louie was awesome and planted the seed of joining. I want to help and be helped by people who all want to start something awesome. I like the idea of being able to talk for an hour about something I know and then being able to show up and learn something I otherwise probably would have never done. So why am I special? I\'m not, but Geekdom is, and I want to be a part of it!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(322,480,'I love to rollerblade, I love to draw, and I love to play online games. Rollerblading gives me a feeling of freedom, as I speed down the sidewalk. Drawing anime makes me feel joyful, because I am able to form and create my own little world where anything I desire can happen (the same goes for playing online video games).\r\n\r\nI love to make things easier than they seem. I am pursuing this business opportunity in programming, so that I may gain the capital to fulfill my dream of being an inventor. I love coming up with ideas that make things simple. By making the minor things in life simple (such as how we wash and dry clothes or how we locate our car keys) we are then able to focus on the more enjoyable and memorable parts of our lives.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(323,481,'I am an innovator and insatiable learner. I take my ideas and do what it takes to bring them to the world. I have successfully done this a few times and enjoy making a difference in the world.\r\n\r\nI have many more ideas and want a good place to hang out as I work on developing them.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(324,482,'What makes me special is being tall, I can pretty much grab anything from the top self that you need and if i cant reach it i\'ll climb my way up there ! \r\n\r\nLOL something most people don\'t know about me is that i have a slight fear of heights (insert tall joke here)...\r\n\r\nI was Time Magazines 2006 person of the year. Feel free to google it.\r\n\r\nAnd my mom still says I\'m pretty darn special !','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(325,483,'Tech: Wordpress deployment and customization. Graphic Design for Web and Print. Specifically, Adobe: Photoshop, Illustrator, Premier. Digital Photography, Photography editing (Lightroom). Cloud computing usability expertise. Web hosting infrastructure strategy.\r\n\r\nBusiness: Team creation, development and leadership. Technology Sales. Marketing plan development and execution. Customer on-boarding and education. Sales strategy and execution. Public speaking and presentations. Change management. Conflict resolution. Business growth.\r\n\r\nI am huge music person. I love playing, recording and listening to many genres of music. Photography also takes a large portion of my free time as well. Photographing live music performances is my favorite subject to photograph.\r\n\r\nI have always been the person to move fluidly through different crowds with different backgrounds. I easily make life long connections on a personal and professional level. I am excited by exciting people with ground shaking ideas. I am not intimidated by another person\'s experience or intelligence. I want to change people\'s lives through the use of technology!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(326,484,'I intend to take on an entrepreneurial path in my career and help shape the revolution in Healthcare, one solution at a time. I have started a business (Lifeline 360) that aspires to lay a communications infrastructure connecting hospitals, nursing homes, rehab facilities, home health agencies with PATIENTS leveraging the mobile platform.\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(327,485,'With 20 years professional graphic design experience and 10 years professional web development experience, I have a keen understanding of the creative and technical aspects of both disciplines. I\'m good at translating geek-speak to the creatives, and vice-versa, and find myself happiest with a foot in both disciplines. I am eager to share my knowledge and experience, and always love learning new skills. And my BBQ skills have been known to make grown men propose to me.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(328,486,'I am currently CEO and founder of SiteB Data Services. My main experience is starting and running a business. Although I have some technical experience ( MCSE NT 4.0 WOOHOO!). I have a wealth of knowledge of how to bootstrap an idea into a business.\r\n\r\nI have been through the ringer a few times. I have started two companies. One crashed and burned and the other is on its way to success. The kind of practicably knowledge that I have gained is something that can not be taught, only experienced.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(329,487,'I read about business and real estate all the time. Especially new ideas. I take pictures and make collages (https://picasaweb.google.com/sarahnyhan). I listen for new music hours and hours out of each week. I tend to get interested in random things and follow the rabbit trails as far as I can. For example, I read an article about the most expensive homes in San Antonio. And it led me to a picture of a home on Bitters that I had been interested about for some time. 425 West Bitters. I researched and found articles about the location and the owners. Turns out the house is 23K square feet. Insane. So then I spent hours researching the family and reading about their businesses.\r\n\r\n\r\n 	I have a ton of ideas. I have passion. I need help with direction and how to implement them without being a lone wolf. I am not currently hanging out with the kind of people who think creatively. They live by fear and I want to take calculated risks and surround myself with likeminded passionate hard-working fun-loving intelligent people.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(330,488,'I love to sing and play in bands. I like to play video games - would love to learn how to design/develop one. Starcraft is my favorite video game of all time (1 and 2). I\'m also a collector of tattoos.\r\n\r\nI think what makes me special is my ability to include and collaborate with others. I\'m also a fan of really digging into technical issues until they are resolved... I\'ve been told that I get an intense focus (visually) when I start working on things. I simply love lending a helping hand to anyone that I can. I was also a 6+ year Racker before parting ways to help lead a startup to infrastructure victory.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(331,489,'I\'m an excellent writer, verbal communicator, and big-picture strategist with enough business world experience to be able to think in verticals, demographics and ROI.\r\n\r\nI have a knack for guiding hesitant Marketing Directors out of their comfort zone and through complex digital projects. I speak visual design and creative development and don\'t presume to do either.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(332,491,'Greetings,\r\nI am Marvin Jimenez photographer and cinematographer here in San Antonio. You can see some of my work on www.cinemaamericana.com and marvinjimenez.com  In addition, I am a full time teacher and will be teaching a STEM elective this year. If you have any short film projects, cooperate photographer/cinematography assignments I am glad to share my knowledge or join crew. Lastly, as mentioned before I will be teaching a STEM elective and since this is my first year doing so I would appreciate anyone willing to help.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(333,492,'I am currently the vice-president of information technology for the Bank of San Antonio.\r\n\r\nI recently graduated from UTSA\'s executive MBA program and am currently acting as a leadership coach to the new incoming class.\r\n\r\nPrior to entering the business world, I was a full-time musician. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(334,494,'Basically, a corporate type / executive manager / finance guy.  Please see my LinkedIn profile for details.  ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(335,498,'I am an owner and former general manager of multiple Harley-Davidson dealership here in the Boerne and New Braunfels areas. I am the Vice-President of For The Love of Kids and Harleys Charity that has raised over 3 million dollars in the last 18 years for St. Judes as well as other charities. I have a production company that does MMA Fights @ Cowboys DanceHall every other month for over 5 years as well as many Rock/Country/Heavy Metal concerts throughout the years. I also have a Spice mixture company that has been sold in HEBs throughout Texas until recently and am looking to re-establish it. \r\n\r\nI\'m an avid golfer. I enjoy all types of sports. Its fun meeting new people and bouncing ideas around. I really like learning about new things and how I could incorporate those ideas into things for myself.\r\n\r\nI feel that I have a really broad range of skills. Ive been a part of alot of really big ideas and executions of those ideas. I think that I can bring alot of things to the geekdom that aren\'t easily found. Im a creator/developer/content/financer dude. Im never satisfied with mediocrity and think that if its not fun than why do it.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(336,501,'Woman + IT specialist + marketing guru + entrepreneur + jazz singer + global citizen','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(337,502,'Entrepreneurship (I started my own business straight out of college and ran it for 8 years)\r\nSmall business marketing\r\nTraining small business owners\r\nStorytelling (makes training more interesting)\r\nUsed to fight fires as a firefighter\r\nKnow how to navigate through Child Protective Services (CPS) for those who want to adopt\r\nEmergency Management (DHS type of stuff)\r\n\r\nI am highly confident in my capabilities and driven to succeed in life and with my family. I don\'t do anything \"half-ass\". \r\n\r\nI do say no to requests for help if I feel it is not part of my overall work and/or will overburden my time. For example, I will help people with startup problems/questions but may not assist in developing a business plan if it will take away from the time I have available to work.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(338,504,'Mixed Martial Arts, UFC, Boxing, Muay Thai\r\n\r\nOne, I love to learn! If I don\'t learn something everyday I feel alone! Two, the average age for independent investment advisors like myself (those that own their own company and are not affiliated with the big box firms) is 57. I\'m 31 years old. I\'m also working as an intelligence analyst so if anyone has any questions on working for a government contractor I can help.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(339,506,'At the Retail Strategy, we are solely focused on tenants. Working with clients at all ends of the retail spectrum, we customize our services to fit their unique requirements. By focusing on four main areas — Tenant Representation, Retailer Services, Franchising, and Marketing — we are committed to finding the optimal retail site location while providing cost saving strategies that will maximize our clients’ sales potential and meet their individual goals.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(340,510,'I enjoy people and connecting them to purpose by showing them what\'s in there hands and how it unlocks there reason for existence.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(341,511,'It\'s been about a year and half since I established my business. I work mostly on a freelance /contractor basis and have learned what I need to know about Social Media and Design communication. \r\nIt is now my intention and goal to place my business into a great niche and start putting together all of my acquired knowledge into a structured, resolved and refreshing new startup.\r\n\r\nFor now, I\'m continuing this all by myself but soon I\'ll start to talk to others and see if there\'s interest in my idea (which still needs refining ).\r\n\r\nI have many ideas to share and lots of knowledge to teach.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(342,512,'We\'re an awesome team, ready to change the world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(343,514,'Reducing the dependency on currency one exchange at a time. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(344,515,'Xavier Ramirez is director of Higher Intention productions. He is currently in pre-production on the film \"I Got Soul\", about James Brown the godfather of soul. The film explores the inspiration, collaboration and stark realities that led up to one of the most successful recording sessions of all time. \r\n\r\nRamirez has had a consistant focus on dance/musical motion pictures. Xaviers background as a professional dancer has led to many diverse credits including footage used in the motion picture STEP UP, and his feature documentary BATTLECRY.\r\n\r\nHowever as a writer Xavier wrote the screenplay \"Rebel\" based on the award winning novel by Andrew E. Stevens \"Rebel with a cause\". Rebel documents the amazing true stories of a carefree youth that became an expert forger serving the anti-Nazi efforts in WWII.\r\n\r\nXavier Ramirez documentary film production and photography was featured in the April 9 issue of VIBE magazine and the January 21st issue of Jet magazine.\r\n\r\nRamirez was selected as a honorary board of directors for the “I Have a Dream Foundation”. Ramirez is founder and CEO of the International Dance Hall of Fame (IDHF). Ramirez handles special events and tours for the hall of fame’s “Legends of Dance” educational outreach program.\r\n\r\nXavier works as a script writer and entertaiment consultant for Los Angeles based JWE. Ramirez previous employment includes Hearst Publications, Clear Channel Communications, RCA Records/Its s Gas artist development division and work as a producer at Acceleration Studios. \r\n\r\nXavier has assisted in development for segments and features on Lopez Tonight, The Jimmy Kimmel Show, America\'s Best Dance Crew, CNN, MTV, BBC, EBONY/JET Magazine & VIBE Magazine.\r\nRamirez is a proud supporter of the Austin Film Society and writes a blog for intent.com\r\n\r\nhttp://www.xavierramirez.com/\r\nhttp://www.higherintention.com/\r\nhttp://www.igotsoulmovie.com/','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(345,517,'Trained in FFA (Future Farmers of America)-Horticulture, Floriculture, Aquaculture studies, along with Animal Science (Agricultural Science).-. Owned and operated a Clothing/Music Store-created an urban (hip hop) fashion line. Managed a few music venues.( worked) Production Coordinator in film projects (Storyboard Illustrator, Cast Calls, Location Scouting). Started an \"Affordable Artwork\" venture. Started the Artbeat Coalition ( live painting and live dj ). Promoted and was Editor for a publication (Expressions Journal/ Rastamon Times-Milwaukee, Wisconsin).I also created a Graffiti Art Magazine (Centerflow) and was an instructor for \"urban\" art class.\r\n\r\nManage classroom setting and carry out lesson plans. grades Pre-K to 12th grade.(Substitute Teacher).Student tutor and mediator. Volunteer at Jimenez Thanksgiving Dinner and Feast of Sharing Christmas Dinner. Volunteer for the Westside Dog Initiative (fostering pets). Volunteer for ALL OF US OR NONE (Legal services for prisoners with children/Youth Program). Organize Fundraisers and Community Events. Live Painting-Mural projects-Face painting and body painting.\r\n\r\nEach day I examine myself on three counts: whether or not I am LOYAL to those on whose behalf I act; whether or not I am TRUSTWORTHY in my dealings with friends; whether or not I PRACTICE what is imparted.\r\nTseng Tzu','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(346,518,'I keep one foot in the academic community and the other foot in motion. Having recently finished a full-time teaching fellowship at UT-Austin, I’m now inventing a new structure for my intellectual and creative work. The project leading me to Geekdom is a concept for an app to design and play custom, photo-based games for fun, education, and network building. With my partner, an Army officer at Ft. Sam, I am looking to connect to people experienced in app development. Much of my own experience, as a writer and editor, has been on paper. But a major print edition I recently prepared (of Gertrude Stein’s long poem Stanzas in Meditation, just out from Yale UP) was inspired and informed by digital capacities: searching and comparing texts on large scales. My current writing projects seek diverse audiences and explore intersections of print and digital media. I’m interested in how language works, and I’m eager to bring that skill to people whose focus goes to current and changing technologies.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(347,519,'\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(348,520,'Well, where to start ... besides inventing the computer, I grew up in the entertainment business. Me and my twin brother (along with my younger brother), grew up singing, dancing, acting, and all of that jazz! It was lots of fun and our home videos are pretty entertaining, although not to say that that is a good thing! I have lived in San Antonio, TX for most of my life, except for when I went off to college in Orlando, Florida. (not to forget my quick visit to Greece back in 63\' during the Olympics, where I received the Gold medal for \'speed walking\'.)\r\n\r\nI am a graduate from Full Sail University with a degree in Music and Film Production. Maintained a 4.0 GPA and received two Course Director\'s Awards. I loved Florida, lots to do and great beaches. \r\n\r\nA little about me ... I would say that I\'m energetic, outgoing, laidback, ... I love the outdoors, indoors, back doors, front doors, side doors, trap doors, and the band \'the doors\'. And yes, I can be corny sometimes (deal with it!). I love learning new things and believe in continuing education. I love meeting new people and socializing. I love to have tons of fun and joke around. There are too many things I like, can\'t write it all. oh, kids are great, gotta love em! \r\n\r\n\r\nWhat I do for fun...\r\n\r\nI love complicated math problems, CNN, short walks on a mound of burning coals, eating live chickens ... you know, the normal stuff! Seriously, I like sports (i think basketball is my favorite), movies, hiking (sometimes), skateboarding, going to new places, meeting new people. Oh and my favorite place in the world is the beach ... it\'s my idea of heaven on earth ... good stuff. I enjoy intellectual conversations ... like trying different kinds of food. I like to read and write and ride my bike (ok, i don\'t ride a bike ... but it sounded good). I really like Dancing. An interesting fact, I used to teach hip-hop at a private middle school. Middle school kids are CRAZY! Let\'s see, what else ... hmmm, too many things, if u want to know more ... it\'s in the book! You can order it online right now for only $19.95! And if you place an order in the next 15 minutes, I\'ll throw in an old spoon and a pair of used socks for no extra charge! ... or, you could just contact me with any questions.\r\n\r\nI have worked with Adam Sandler, Justin Timberlake, and Stevie Wonder ... just to name a few.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(349,521,'I love television and film. I love writing screenplays as well as just for fun. I read a lot and watch a lot of movies. Something else that I like to do is teach, I help out whenever I can as a tutor and kind of a mentor for things that I can help with.\r\n\r\nI feel like I have a lot of experience in the field of content creating for my age. I was part of a after school non profit program called SAY Si. So I have gotten accustomed to being around a large group of people that are talented as well as engaged. I have entered in many film competitions across Texas. Eventually Cool is a website that I founded in which my friends and I create/distribute short films and skits whenever we can. I direct and edit them and sometimes serve as the writer as well. I have a director reel which has given me a lot of attention which can be found here: https://vimeo.com/49145320 I really hope to be a part of this amazing community that is Geekdom.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(350,522,'I am currently learning post production editing and special fx. I have worked with editors many times but with current projects, I\'m having to do my own editing and I\'m loving it.\r\n\r\nI am extremely motivated and love to get groups together to do short and full feature films. I like to make things happen and involve those who are interested in learning. I do not fear failure but the regret of never taking the attempt.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(351,523,'I have registered a website for the purposes of teaching piano online. The site should be up in about a month. My goal with geekdom is to find a group of marketers who could help me promote the site. Although I don\'t have any computer skills, I can arrange, perform, and edit all kinds of music. If you have any startups that need background or theme music recorded, I have experience with this and can aid in contracting musicians.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(352,524,'Currently training for the Tough Mudder. Tough Mudder events are hardcore 10-12 mile obstacle courses designed by British Special Forces to test your all around strength, stamina, mental grit, and camaraderie. With the most innovative courses, half a million inspiring participants, and more than $3 million raised for the Wounded Warrior Project, Tough Mudder is the premier adventure challenge series in the world.\r\n\r\nI come from a big family but I act like I am an only child. \r\n\r\nI am one of the few people in San Antonio who is still single, no kids and lives in their own apartment with no roommates.\r\n\r\nI am still trying to figure out what my special super powers are.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(353,525,'I always want to learn something new. If I want something done I would rather learn to do it myself, rather than ask someone to do it for me.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(354,527,'I am a sole proprietorship offering administrative and technical support to professional speakers.\r\n\r\nI run my business using open source software and and an open source and Linux advocate.\r\n\r\nI am an adjunct instructor with St. Philips College. I teach basic electronics, computer maintenance, and computer networking.\r\n\r\nAs a hobby, I rebuild old computer systems using Linux operating systems and try to place them in community and youth programs.\r\n\r\nI have been a geek since my first Atari computer. I have a variety of experiences that apply to the Geekdom idea and look forward to participating and helping.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(355,530,'Strong Business Development/Sales experience within technology (from startups to mature companies);\r\nFormer Racker (2002-2006)\r\nFormer Microsoft-ie (2006-2011)\r\nWell-connected in local, regional and national circles within private and public sectors\r\nHave numerous affiliates that possess special skills and experiences that can potentially be used to enhance Geekdom\'s brand\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(356,531,'.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(357,532,' attended and won best in show at the Northwest New Vistas in Media contest, I received software, internship, and a scholarship. I have done video editing as well as playing for various bands in the past. I have also worked on a couple of projects for mobile games.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(358,533,'I am a student currently studying Computer Programming/Network Security.  I am getting quite a bit of a late start at school, but am determined to get this degree.  I am excited to be a member of Geekdom to meet like minded individuals without having to drive to Austin!  ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(359,534,'ENTREPRENEURSHIP\r\n•	Relocated from San Francisco & presently starting a local San Antonio business\r\n•	Started, managed (and sold) 4 profitable businesses\r\n•	Started, launched, managed 5 nonprofit companies/organizations\r\n\r\nBUSINESS COACHING (certified)\r\n•	J.O.B. (Just Our Business Consulting)\r\n•	Business Start-up Roadmap- Sales, Marketing, Management, Team Building\r\n•	Start-up Funding, Grants\r\n\r\nINSTRUCTIONAL DESIGNER (certified)\r\n•	Facilitator, Instructor\r\n•	Business Blueprint Courses\r\n•	Content Development, Deployment\r\n\r\nWEB DESIGN\r\n•	UX - User experience\r\n•	IxD - Interaction Design\r\n•	UI - User interface / Graphical User Interface\r\n\r\nGRAPHIC DESIGNER/PHOTOGRAPHER\r\n•	Branding\r\n•	Visual Presentations, Artwork, Copy Layouts\r\n\r\nMARKETING/PROMOTION/LAUNCHES\r\n•	Social Media\r\n•	Business Marketing Strategy \r\n\r\nMy interests include travel, technology, The Arts, photography, graphic design, construction, cooking, reading, research, movies, skiing, rock climbing, hiking, flying, sky diving, surfing, scuba, 4 wheeling, camping, volleyball, cycling, water skiing, - I love biking or hiking or anything outdoors really… a good, stimulating conversation and fun people.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(360,535,'I am an unabashed veteran of the tabletop roleplaying game hobby (\"if you don\'t have to do math, it\'s not gaming\"). i play the drums. I do alot of trailrunning. i secretly believe that somewhere deep inside me dwells kung-fu.\r\n\r\nI used to be a big tool - i wanted to be a hot shot hollywood camera guy and be rich and handsome and travel the world doing work that other people thought was cool. One day I realized I was working on projects I didn\'t care about for people I didn\'t respect. So I packed up my life and came back for what I thought would be a year or so. It\'s been four.\r\n\r\nI\'ve worked with movie stars, so titles and big names don\'t impress me. I worked in a hospice for a couple years, which taught me that at the end of the day the person you will be most thankful for is the one who rolled up their sleeves and changed your diaper when you were too weak to clean the shit off of yourself and it\'s not going to matter how they\'re related to you, how much money they make or what they look like. I went to india and lived off of a bicycle for three months - I haven\'t had a single complaint about life since.\r\n\r\nI know where I want to end up, and that\'s doing my own thing. What\'s the old quote? \"If you don\'t build your dreams, someone else will hire you to build their\'s?\"','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(361,538,'Bachelor of Arts Degree with major in Advertising, minor in Studio Art, worked professionally as graphic designer (print and web), web designer and UX/UI designer.\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(362,541,'Logo and Advertisement design, Photography, Videography, Marketing, Information Security, Entrepreneurship and Creativity, Network Planning and Management\r\n\r\nLet\'s see... I was working with a medical records startup before I even went to college. I put together a nonprofit called LectureBank that runs a web service connecting postdoctoral researchers to lecture & talk opportunities in the area. I\'m currently volunteering with Harvard University\'s student run bike share, CrimsonBikes, doing some really cool stuff-updating the website here and there, but also creating a new, interactive bike rental kiosk where a key safe is controlled by a Kindle Fire that accepts an ID swipe from a Square card reader (\'cause it\'s free). I always have my hands in a ton of projects, and I\'m always generating ideas. I\'m quirky and opinionated, but that makes me a lot of fun to be around since I always make sure to listen to others and consider their thoughts too. I\'m super high energy but not too high strung, and I\'ll figure out whate ver you throw at me. I\'ve had a wide range of tangential experiences, from interning in the control room running graphics at KLRN during their summer auction season, to writing a full-length screenplay, filming promo videos, taking product pictures, coming up with logo ideas and working them into a final product, and even finding creative ways to use my lockpicking skills and HAM radio license (I had to pick open a key safe where-ironically-the battery for the keypad died and the master key got lost, and apparently with an amateur radio license you can transmit and receive on the same band some RFID chips use, so I can build my own antenna!). Right now, I\'m working at a local insurance company and working with the CEO to start a new venture-we\'re very excited about it, but I definitely need a creative space!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(363,542,'Hailing from Ecuador, I am a MBA without the attitude, have worked in non-profit, for profit, higher education and government sectors. I was appointed to a public position by a president of the United States hopeful!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(364,543,'I am a grad student at UTSA that just relocated to San Antonio all the way from the island of Puerto Rico. I\'m a Web and Mobile Developer and someone with a lot of awesome ideas. Since 2005 I have been coming up with ideas and even made some of them a reality.\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(365,360,'Hello there. I\'m an owner of CADBRUSH and CAD/BIM/3D “digital nomad” designer.\r\n\r\nMy specialty is both digital and traditional visual art.\r\n\r\nI love meeting new people from different cultures and love working while I travel.\r\n\r\nOriginally from Kobe, Japan (famous Kobe beef!), I\'ve lived in  cities such as Atlanta, Chicago, Honolulu and now in San Antonio, TX. \r\n\r\nCurrently I collaborate/work with clients in Hawaii & Chicago....and hope to collaborate with fellow nomad designers around the world. \r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(366,544,'I\'m like an onion.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(367,547,'Solving problems and making decisions.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(368,548,'Im just freak.n awesome.!\r\n\r\nHere to learn and make new connections.. pretty darn easy to get along with.. \r\n\r\nlook foward to meeting some geeks.. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(369,549,'At a Java based startup (Triemt) now.  Worked at .Net based company maintaining web apps from 2007-2012.  Worked at a .Net based startup (SnapStream) from 2000-2006.  ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(370,550,'I enjoy anything that is competitive - fantasy football, rock skipping contests, calling shotgun so I don\'t have to ride in the backseat - anything! I like hanging out with my kids. I enjoy working with other people on projects that involve solving problems.\r\n\r\nI am good at identifying the \"big picture\" challenge and breaking it down into smaller, achievable pieces of work. In other words, project management that doesn\'t feel like project management. I\'m organized and task-driven.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(371,551,'Worked on the corporate & client side of the international education/ language travel industry for 7+ years.  Currently freelancing in business & international education consulting.  Looking to pivot into the tech+education sector. \r\n\r\nSelf-taught tech and design geek, always open to learning new things.\r\n\r\nLooking to network with designers, developers, and other fun people.  Say hi!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(372,557,'I have created a diverse and powerful IT management platform that is capable of being launched into multiple sub markets that has already drawn attention from large business entities and investors. I am currently seeking both developers and programmers to help with project completion, job openings availiable as company grows.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(373,559,'I have a masters license from the State of Texas for electrical, have been working with electronics since I was a child, and have done schooling geared towards electrical engineering and public management, Currently I am an Inspector for the City of San Antonio and am enrolled at Texas State University.\r\n\r\nI love working with technology,experimenting, and just have a natural knack for electronics. I believe that although I may not necessarily know code, I do have the ability to learn and I have lots of experience in a multitude of fields that can give something of its own.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(374,560,'www.luxurydreamhotels.com\r\nFirst ever Online Travel Agency based on HD videos.\r\nPlus smart online biz tools for luxury boutique hotels with www.smartehotels.com. Part of the www.onemilliondollarsfilm.com team; a features movie production financed by pro athlete around the globe\r\nI cook too...','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(375,562,'Passionate about technology education.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(376,563,'Love to network and