ubjects, such as Linguistics, Biology, and Psychology.\r\n\r\nI believe that my work ethic helps me stand out. I love to learn and develop new skills, but I understand that to gain knowledge, to create new things, and to master these skills, I need to put in the effort. I have a BA With Honors in Creative Writing with minors in Mathematics, Spanish, and Music from The University of Arizona. Now, I am continuing my education at UTSA, studying Computer Science. After my first semester, I was able to get an IT internship with USAA, where I implemented a utility to be used during financial processing. \r\n\r\nI have really enjoyed both my academic and work experience in programming, and I am very motivated to continue learning and progressing in this fast-paced field. Now that I have a good grasp of the basics and have gotten a taste of professional development, I am especially excited to put my skills to use in creating new and useful software. I look forward to collaborating with people as I learn more about programming and technology.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(381,571,'I\'m friendly and approachable. I have the ability to process and interpret information quickly. I don\'t like taking short cuts to solve problems. I like trying to find alternate paths to the same ending. I want to make a difference in this world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(382,572,'Since graduating from high school in San Antonio, I\'ve studied / worked in Spain, Germany, China and Argentina. I love helping individuals utilize technology to improve our world. I\'m a full time web marketing consulting and head up the tech/marketing team for a start-up that offers membership to an electronic trading system for carbon credits of all types (ie meet US, Australian & European market standards). I have a constructive and creative mindset which lends itself well to translating technical processes to non techies.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(383,574,'Father of two great kids living in Spring Branch Tx.  Spent the last 7 of 12 months commuting to Los Angeles as VP of Sales for Lunarpages.  Proud ex 7 year Racker; employee 225.  Over 20 years of sales and sales leadership experience working in intangible and tangible sales.  Currently consulting for Ijhana www.ijhana.com, a Ecommerce Developer.  I am also an Advisory Board Member for a startup Mobile Web America and President of my consulting practice NQ Consulting.\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(384,576,'Creating Solutions in a World of Big Data','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(385,577,'We have an Anime meetup group:\r\n\r\nhttp://www.facebook.com/groups/183491171681457/\r\n\r\nand are looking for a centralized place where we can meet, watch, share, and discuss Anime and Japanese culture in general. We have been more active in the past, but lack of a standard meeting place has made things difficult. I heard of Geekdom from my colleagues at Rackspace and was curious to see if it would work as a good meet location, starting as once a month and expanding to biweekly if things pick up.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(386,578,'His passion is to assist others in their journey for success. \r\n\r\nCraig is the loving husband and best friend of  Leslie A. Grubbs.  They are co-labors in community transformation at Urban Connection-San Antonio (a holistic, faith-based, human and community development organization) where she resides as the Visionary and Executive Director.  They are the proud parents of two children and two grandchildren. \r\n\r\nCraig is a Community leader, teacher and mentor who loves to serve people. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(387,579,'I grew up in the small town of Bulverde, TX about 20 miles north of San Antonio. Just nine days after graduating from Smithson Valley High School in 1994, I left for Orlando, FL to start my eight year career as a Nuclear Electrician for the United States Navy.  \r\n\r\nDuring my time in the navy I was stationed in Orlando, FL, Charleston, SC and Norfolk, VA and visited many countries across the Atlantic Ocean including Greece, Turkey, and the U.A.E. I received the rare honor to commission the U.S.S. Harry S Truman (CVN-75) and was part of the team to bring her reactors critical for the first time.   \r\n\r\nI’ve been back in San Antonio since 2002 programming and designing control systems for various manufacturing lines and industrial process. I’ve programmed and worked on everything from tape laminating lines, to Ice cream, to machines to that shreds cars in less than 30 seconds.  In fact, if you’ve ever eaten a tortilla chip from HEB, you’ve experienced my handiwork.  Currently I’m a partner in a software company that designs historian systems to collect, store, and analyze for various industrial processes. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(388,580,'I\'m middle-aged and still love to code and learn new technologies. At an age when my contemporaries are attempting to secure a middle management position safe from the whirlwind of change that software engineering imposes on its practitioners, I have embraced the tempest (ok, a little dramatic) and prefer to be on the front lines slinging code.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(389,581,'Junior at Trinity University, Computer Science and Business Administration double major.\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(390,582,'I am a US Army Veteran, former DUSTOFF pilot, and the co-founder and CEO of Adjacent Applications (www.adjacentapps.com). Adjacent Apps recently launched the mobile app Call Dibs on 1 June. Call Dibs is a free mobile application; exclusive only to the military community that allows active duty, dependents, veterans, reservists, and the DOD to buy, sell, and exchange goods. Call Dibs is currently available in iTunes.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(391,583,'I like people- I think that goes a long way in the business world. Basic understanding of HTML, CSS, graphic design, social networking- all from starting amateur singer-songwriter music websites.\r\n\r\nEntertainment (especially music and film) and fashion. Lived for 5 years in Los Angeles, CA exploring various music/film-related occupations: singer-songwriter, trailer production house, movie studio tour guide, screenwriting, film direction/editing, comedy improv, acting. Currently looking to start a small t-shirt line.\r\n\r\nI\'m currently a Navy officer based here, and part of my work deals with very technically-minded people. I\'ve come to realize that I\'m more people-oriented, so I want to hook up with technical entrepreneurial types so we can complement each other and create some value.\r\n\r\nBeing into entertainment and fashion, I probably am not the typical Geekdom member, but I think as long as the common denominator here is to create some value for others in a business, I think there\'s some common ground to be had.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(392,584,'I\'m current getting my \"Associate in Information Technology\"\r\n\r\nI have Passion, motivation, and desire. I have a passion to want to learn and learn as much as possible. I have the motivation to do something more, to keep going even when I struggle and the desire to reach my goals. The desire that there is still something more to this life, knowing that greatness is achievable.\r\nI have three very good reasons that keep me going. They give me my strength, my love, and my faith, which are my three wonderful children. I want to succeed in my life because my success will be there success. I believe that successes leaves foot prints and I want them to follow in them. I’ve lived a life of mediocrity and thought “wow this is it…” but something dramatically change all that. Ill proudly say divorce was the turn of my rebirth into my new life. Into a new life were I changed and will find my