nes), and more.\r\n\r\nI think we\'re all special. We all have the potential to give something unique to the world. It\'s just a matter of getting out there and doing it.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(408,612,'I am an alumnus of 3-Day Startup (Fall 2012) where I pitched an idea called Airloom. I also am helping fellow Geekdom member Jim Pyle with his Kickstarter campaign for his project, The Amazing Jellybean.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(409,613,'José Alejandro Flores has 3 passions: International Business, Helping Others and the global sport of Soccer. The fusion of the aforementioned drove him to establish DeFlores, LLC International which is the International Merchant Trading Company that owns the trademark rights to the eco-friendly VOS® brand.\r\n\r\nJosé Alejandro is an international entrepreneur by nature; having the advantage of also applying his invaluable knowledge acquired by his multi-national corporate experiences over the years and his International MBA. Philanthropic principles are ingrained in his personal and professional values, which in turn he readily applies to his vision of the VOS® brand. The commitment to be an environmentally conscience brand along with contributing to the social responsibilities among global communities in need, are done in a manner that is second nature to him and his organization.\r\n\r\nHaving charismatic parents of both U.S. and Guatemalan nationalities has provided him with an identity benefit, exposing him to a culturally diverse environment his entire life. He has utilized this identity benefit as an inspiration for the creation of the VOS® brand, infusing his ongoing life experiences in both the developed and developing worlds. His first-hand awareness of the endless array of issues that our global communities face, led to the simple but profound question: Can you afford to care?\r\n\r\nHis multi-cultural background and international mind-set permeates into all aspects of hi