wn a better place to live, work & play!\r\n\r\nAwarded:\r\n2012 Best New Downtown Business by Downtown Alliance \r\n2012 Best Entrepreneur by San Antonio Magazine Readers','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(414,620,'I\'m Vanessa - gamer, writer and entrepreneur. I\'ve been a gamer all my life but have been able to make a career of it. I play professionally with Major League Gaming with Synthetic Reality Gaming (SRG). When I\'m not playing I\'m writing about gaming and gaming news. I head a website, Gamer Assault Weekly. We do news, reviews, videos, events, and interviews. I also do promotional appearances, host events and model for Curb Stomp Modeling. \r\n\r\nI\'m well rounded when it comes to business. I have skills in website development - I\'ve developed HTML sites as well as working on WordPress and Joomla. I have a degree in Public Relations and am skilled in online branding, marketing and advertising, public relation campaigns on and offline, social media marketing, and graphic design. I\'m a published editor as well so writing and editing is a strong point. I also do video creation, video editing, on camera hosting and modeling. I\'m also good at building business partnerships and relationships. \r\n\r\nOutside of working I enjoy reading, mostly about science, physics and the cosmos. I love to dance - I\'m outgoing, expressive and creative. I also enjoy being outdoors and staying active as well as traveling and getting to see new places and have new experiences.\r\n\r\nI\'m always willing to lend a hand, an opinion or idea if anyone needs it! ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(415,621,'I like to take action first and consider the consequences later, as I have found that my gut intuitions have rewarded me more than analysis paralysis.\r\n\r\nI am active in my community; I currently serve as the GOLD Chairman of the IEEE Central Texas Section (CTS) and an Executive Committee member, I am an Ambassador for the Army eCYBERMISSION for Science, Technology, Engineering, and Math (STEM) initiative in Texas 6th-9th grades, and I volunteer for the Veteran\'s Affairs.\r\n\r\nI work as an Enterprise Architect and delve into Citrix Virtualization, SAS Business Intelligence,  Entrepreneurship (Owner of Crev Dev, LLC.), Emotional Intelligence with S.M.A.R.T. Objectives training, Change Management, Strategic Risk Management, and Process Improvement.\r\n\r\nI am a certified as a Lean Six Sigma Black Belt, ITIL MALC, and PMP.\r\n\r\nI enjoy hiking, mountain biking, remote control (R/C) Off Road Buggies, wood work, learning guitar, travel, SCUBA diving, and just being outside enjoying nature.  I previously was a Master Plumber for 16 years and still fix this and that around my neighborhood for those in need.\r\n\r\nI have an ability to communicate with all types of people in a manner that conveys the message appropriately for the sender and the receiver. This has helped me help those around me most.  I am most interested in using the best gift of all that we all have, our imagination.  I look forward to sharing knowledge with Geekdom members.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(416,622,'I love to play chess and poker, enjoy practicing Brazilian Jiu-Jitzu, kind of like working out, and started playing rugby not too long ago. I used to draw often, but have slowed down over the years. The same goes for reading and writing for pleasure. I also like challenging people to arm wrestling and foosball matches. I really dig expensive cars that I cannot afford as well as bargain fashion and good inexpensive food that I can afford.\r\n\r\nSo, here is the quick and dirty: Well, besides the fact that I\'m one of the coolest and smartest people I know, I also have a great entrepreneurial and a very creative spirit. \r\n\r\n\r\nAnd here is the long and beautiful:\r\nI was born in Suriname, South America and moved to the Florida at the age of nine. I was bitten by the entrepreneurial bug at a young age, but my first few ventures were not tech related. As a kid I distributed fliers for Realtors in my dad\'s real estate office and later began to design the fliers as well. \r\n\r\nI never held a real job until college, where I worked as a Librarian Assistant; spending most of my time reading and writing. In my college town there was a fair amount of construction going on and I saw an opportunity to sell lunch plates to construction workers. I also set up a snow cone stand on campus and at local events. \r\n\r\nLater I started my first legally filed corporation; a graphic design business. I did a lot of work for little pay to get experience and to attract clients.I then wanted to experiment with e-commerce so I built a couple of web stores, both for the learning experience (so I can offer the service to my clients) and with the hopes of hitting it big online. Long story short, the experience was good.\r\n\r\nI decided that I would attend grad school at another university in the same city, so I bought a town house and also became a landlord. This got my interested in real estate for a little while, where I made a few small deals and quick cash. \r\n\r\nI secured a job at FSU prior to graduating because they would pay for my degree. I was going to pursue my Masters in either Web Architecture or Creative Writing. It was really tough choice, but before I could make it I was recruited by a college friend of mine to help him run his family business that he had recently taken over here in San Antonio: A non-profit company whose misson is to provide employment to individuals with disabilities.\r\n\r\nI currently still work there as the Resource Manager and also do some sales. However, I did take some time off to go teach English in Korea, and actually ended up staying for two years. It was an amazing experience and that is where I ran into the woman that occasionally calls herself my wife. \r\n\r\nI came back in San Antonio last year, but since I\'ve been back it has only been work and more work. I love what I do and truly feel that I am making an impact, but I still need to create and build something of my own or with a group of people from the ground up. I am seeking to surround myself around creative and driven folks for inspiration, support and collaboration. I recently attended a blogging seminar at Geekdom and fell in love with the place. I wish I knew it existed sooner. At any rate, here I am now. \r\n\r\nAside from all that, I am really really special!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(417,625,'A dedicated warrior who has returned to society battered and bruised but still kicking... He is returning to his roots of creative thinking of filmmaking, photography and graphic design. \r\n\r\nHe has a deep sense of brand in his work and approaches his work from the idea that the story must be deep and compelling.\r\n\r\nYup that\'s me','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(418,628,'Media Director. Producer. Filmmaker. Editor. Cinematographer SEO. OMS. Marketing. ','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(419,630,'Currently a senior majoring in Computer Science and Economics at Trinity University.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(420,631,'I\'m enthusiastic and curious to learn more about everything and I always have ideas running through my head that could potentially evolve.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(421,632,'I am an automotive fanatic who works at Starbucks, as well as an aspiring euntrepreneur.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(422,633,'Co-Founder and Talk Show Host on Talk Now SA.\r\n\r\nSpurs Net Center anchor on WOAI.\r\n\r\nContributing Writer for San Antonio Magazine.\r\n\r\nIn 2009, \"The Chris & Jason Show\" was chosen as Critics Choice for Best Talk Show in by the San Antonio Express-News.\r\n\r\nIn 2010, was named \"Best Radio Talk Show Host\" by San Antonio Magazine.\r\n\r\nIn 2011, was named one of five \"Men of The Year\" by San Antonio Magazine.\r\n\r\nIn 2011, named \"Best Radio Personality\" by San Antonio Magazine.\r\n\r\nIn 2003, the \"Chris & Charlie Show\" on WOAI became the #1 listened-to radio program (among all San Antonio stations, AM & FM) in Afternoon Drive by 25-54 year old listeners.\r\n\r\nIn 2006 and 2007, The Chris Duel Show on KTSA was voted \"Best Local Talk Show\" by the readers of The San Antonio Current\'s \"Best of San Antonio\" issue.\r\n\r\nServed four seasons as official courtside host/presenter/entertainer at the San Antonio Spurs NBA home games.\r\n\r\nCo-starred with actor John Schneider on KSAT-12\'s reality television show \"Gimme The Mike,\" which gave South Texas singers a chance to reach for their dreams.\r\n\r\nHave traveled extensively, broadcasting from such remote locations as the aircraft carrier U.S.S. John C. Stennis while it was deployed for combat in the North Arabian Sea after 9/11, and he was one of ten talk show hosts nationwide selected to broadcast from Ground Zero on the first anniversary of the terrorist attacks. Have also broadcast from various NBA cities on the Spurs road to the Championship and from two Super Bowls. In 2004, took his KTSA show to Israel for live broadcasts from the Holy Land.\r\n\r\nHave delivered motivational presentations to major corporations, including Abbott Laboratories, AT&T and others.\r\n\r\nEarned a B.A. with a double major in broadcast journalism and film from the University of Southern California, along with a Masters degree in film producing from the USC film school. \r\n\r\nSpent two years as a Cadet after earning an appointment to the United States Air Force Academy near Colorado Springs.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(423,634,'What makes me special? My ability to understand the numbers and be creative in finding funding from banking institutions.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(424,635,'-Mechanical Engineer by degree. Specialization in mechanical, fluid, and thermal systems; Dat