r things!','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(456,767,'Taylor Trash Productions Inc. was founded by filmmaker best friends, Dylan Cody Altman and Taylor James Johnson. Working as a two man crew since high school, Taylor Trash Productions Inc. has been widely recognized around the world for their short satirical films, dramatic documentaries on social issues, riveting music videos and thought provoking animations. Their cinematic mission is to provide the world with images and stories that will inspire greatness and make faces explode with comical comedic comedy.\r\n\r\nAlso, they are not afraid to shamelessly self promote...so go to his website at www.taylortrashproductions.com to find out why!\r\n\r\nSUBSCRIBE to our Youtube pages please\r\nhttp://www.youtube.com/user/thedylanaltman/featured\r\nhttp://www.youtube.com/user/taylorjamesjohnson99\r\n\r\nwatch TAYLOR TRASH on FUNNY OR DIE here\r\nhttp://www.funnyordie.com/taylortrashproductions\r\n\r\nTUNE IN Mon-Fri around 10:40am and 12:40pm CENTRAL TIME\r\nListen Live ONLINE or hear the PODCAST at\r\nhttp://ktsa.com/pages/5996495.php?\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(457,772,'Shelby has more than 7 years of solar energy industry experience and came to Meridian Solar after\r\nsuccessfully building and running a nationwide residential solar energy installation company. He currently serves on the Board of Directors of Solar San Antonio, a cutting edge non-profit organization making solar\r\nenergy a major contributor to the creation of the new energy economy. Shelby received his MBA in Management and his Bachelor’s degree in Business Administration, both with high honors, from St. Mary’s University of San Antonio, TX while on scholarship supporting the NCAA Division II Men’s Soccer Program.  Shelby is also a former Rackspace Hosting employee, Racker, who supported the Talent Acquisition and growth strategy for Rackspace in the USA and EMEA (pre and post IPO), serving the company on both sides of the pond.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(458,774,'Offering small business technology support specializing in non-profit management in the San Antonio area. For more details about monthly service plans, visit xyolo.net.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(459,775,'Sometimes he wishes he could sum up his life in just one sentence. It would go something like “I was born, I lived, and I died” but of course it’s not that easy.\r\nDylan Cody Altman came into this earth exactly 215 years after Patrick Henry delivered his famous “give me liberty or give me death” speech during the American Revolutionary War. He knew from that day that he had big shoes to fill if he were to change the world. At a young age he realized that his mind saw things differently than other people. He discovered that his imagination was a very powerful force. This was either the beginning of something magical or a downward spiral into the complete destruction of the universe. Luckily he used his power for good and the history of mankind was forever safe. He used his power to create different universes and stories he saw in his mind. Instead of turning in paper assignments and book reports he would turn in short films, which soon became more than just a hobby. This love for film lead him to enroll at the North East School of the Arts where he met future film partner and best friend Taylor James Johnson (rumor has it the friendship sparked over a conversation about their love towards the movie Napoleon Dynamite. But this is only a rumor). As he grew older his love for film became something much more. It became way to express his ideas and tell his stories to the world. After high school he attended Santa Fe College where he accepted a full ride for his talents in film and soccer. After spending a year growing as a filmmaker he realized that soccer and the small city of Santa Fe where holding him back from his destiny. After deciding against Miami because of the bad weather, Dylan took his talents to the Windy City where he was accepted into the prestigious film program at Columbia College. He has since then left Columbia College and currently lives a busy life traveling back and forth from Chicago to San Antonio and other parts of the world making films of every genre for Taylor Trash Productions . Stanley Kubrick said it best when he said “If it can be written, or thought, it can be filmed.”\r\n\r\n\r\nSubscribe to my youtube channels here\r\nhttp://www.youtube.com/user/thedylanaltman\r\nhttp://www.youtube.com/user/taylorjamesjohnson99\r\n\r\nwatch TAYLOR TRASH on FUNNY OR DIE here\r\nhttp://www.funnyordie.com/taylortrashproductions','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(460,777,'I\'m a full stack dev working mostly in Scala with the Play! Framework but I\'ve also worked extensively with C# and ASP.NET.  Plus the requisite JQuery, Backbone.js, CSS3, etc. experience.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(461,781,'Solutions Architect @ Rackspace\r\nIT Management consulting with xGates Inc.\r\n\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(462,783,'I Grew up in my family\'s landscape construction company and learned how to work. \r\n\r\n\r\nPlayed a ton of sports through High School and learned how to be a team player. \r\n\r\n\r\nStarted a T-shirt company and learned that no one cares about your designs, only the execution of them. \r\n\r\n\r\nBuilt a student staffing website and learned that I needed help... from mentors, peers... and unfortunately expensive professionals. \r\n \r\n\r\nGraduated from Trinity University and learned HOW TO LEARN\r\n\r\n\r\nBuilt a Riverwalk Bar and Learned the city process (cough... HDRC)  and how to use grant fundings. \r\n\r\n\r\nStarted an off-site greenhouse co-op and learned that many people want to do their part in changing the world for the better through diet.\r\n\r\n\r\nWhile in the process of building another bar at Pearl I\'ve learned that great things take great patience. \r\n\r\nI\'ve learned that the difference between where you are and where you are going is only a measure of how much pavement you put beneath your feet. \r\n\r\nI\'ve learned that success is a never-ending battle... uphill at that. \r\n\r\nAnd at Geekdom... I learned that Im not the only one crazy enough to follow their dreams, aspirations, and \"hunches\" that they are on to the next big thing. \r\n\r\nUltimately, Ive learned.... that I\'m still learning. \r\n\r\nHit me up.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(463,788,'Looking for a way to help immigrants and citizens Keep America At Work.\r\n\r\nGetting ready to start developing Buried Where','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(464,794,'Squishy...','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(465,650,'Media and PR Guru..Publisher...Producer...DigitalMedia','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(466,803,'1972-1980 Owner Kelfer Glass Tinting/Automotive Repair\r\n1980-1988 Freelance Legal Publisher/Typesetter/Programming\r\n1988-1991 Owner Universal Midi Music Computer Company\r\n1992-present Hypertext Index Tracking Systems LLC\r\n2011-present Lawyer Client Publishing\r\n\r\nI am currently involved in a project that connects lawyers with potential clients who are reading law online using a resource I developed originally for the Texas county judiciary 15 years ago.\r\n\r\n-Background-\r\n\r\nIn 1988 I was working as an independent software developer creating programs to manage complex corporate policy and procedure manuals for legal publishers. I developed a process called Computer Assisted Typesetting Service (or CATS for short) that was used to help legal publishers prepare reference material for printed publication. My specialty was developing comprehensive printed indexes for large legal publications with lower costs and rapid turnaround times.\r\n\r\nIn the mid 1990\'s I decided to apply the principles I had learned in the development of CATS to online content. This spawned the development of a technology called Hypertext Index Tracking Systems (HITS), which, among other things, enabled me to quickly collect large amounts of reference material from multiple varying sources and compile it into cohesive volumes suitable for professional publication both in print and online, with some of the most comprehensive indexes ever created.\r\n\r\nIn 1995 I began using these techniques to help a very large Texas Association compile and publish county judge benchbooks which are essentially very large reference books covering many topics related to judicial education and the commission of judicial services from the bench.\r\n\r\nWhile working on these projects it came to my attention that the government was using many millions of taxpayer dollars each year to look up its own laws and codes (as well as court opinions). I was also struck by the fact that most ordinary citizens had little or no access despite the fact that \"ignorance was no excuse\".\r\n\r\nResearch revealed that in fact no one can copyright the law and that anyone has a fundamental right to publish it. The \"hacker\" in me decided to download the Texas laws and codes, strip out any value added content that might be copyrightable and publish my own searchable version on the Internet as a demonstration of the public\'s right to access. I did this with no aspirations for monetary gain. I simply wanted to promote open government and demonstrate the Internet\'s potential for public dissemination of the law.\r\n\r\nIn 1997, at the request of the state judiciary for whom I had been assisting with the publication of county judge benchbooks, I began using HITS to publish on-line versions of the Texas laws and codes for use by the county judiciary.\r\n\r\nIn 2000, I was asked by the Texas Supreme Court to address the possibility of using this system to return case law to the public domain. At the time, the Committee on Information Technology was studying the effect of the Internet on the future operations of the Texas judiciary. \r\n\r\nUnfortunately, after more than a year of deliberation the committee was politically divided on whether or not it\'s legal charge under the statute authorizing its existence included concerns for access by the general public. Coincidentally, at the exact same time, the two major pay services reduced their pricing substantially to the judiciary in apparent exchange for dismissal of any interest in projects that would return case law to the public domain.\r\n\r\nDespite the reduction in pricing, most county judges and county employees preferred reading statutory content from our service, so we continued to operate albeit without case law.\r\n\r\nOver time, this resource which was never restricted from public view, came to be used by the general public en masse. Today, this resource now sees millions of page views per month, largely from private citizens using the Internet to research law. These individuals are often in need of legal assistance. \r\n\r\nMy mission now is to promote open government by providing this resource as a free public service while at the same time enabling qualified legal professionals to connect with these highly targeted potential clients.\r\n','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(467,804,'Owner - Moseley Print Group\r\nSound Engineer - Mo-dels\r\nLawyer Client Publishing','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(468,816,'God has blessed me with a specific set of skills and abilities; especially in the areas of technology, public speaking and sales. I thrive on solving my customer\'s problems no matter the scale, and always get a kick out of getting paid to do what I love! As a fellow geek I know some don\'t do so well in front of customers, but I don\'t shy away from being social and believe face-to-face is still the best way to get business done even in today\'s Web 3.0 world.','enabled','2013-06-05 20:24:19',NULL,NULL,NULL),(469,820,'Architect, de